VALUES (173, 173, TIMESTAMP WITH TIME ZONE '2019-07-29 17:02:23+00', 'Quase piramidal, que no regaço
');
VALUES (173, 346, TIMESTAMP WITH TIME ZONE '2019-07-29 19:59:57+00', '"Passada esta tão próspera vitória,
');
VALUES (173, 346, TIMESTAMP WITH TIME ZONE '2019-07-30 00:26:58+00', 'A quem Neptuno e Marte obedeceram:
');

VALUES (174, 176, TIMESTAMP WITH TIME ZONE '2020-05-08 09:50:21+00', 'O grã progenitor dos Reis primeiros.
');
VALUES (174, 582, TIMESTAMP WITH TIME ZONE '2020-05-08 10:17:59+00', 'Pelos sinais que neste rio achamos
');

VALUES (175, 198, TIMESTAMP WITH TIME ZONE '2019-09-27 16:53:02+00', 'De uma os cabelos de ouro o vento leva
');
VALUES (175, 176, TIMESTAMP WITH TIME ZONE '2019-09-27 23:56:37+00', 'Tão querido de todos, e benquisto,
');
VALUES (175, 176, TIMESTAMP WITH TIME ZONE '2019-09-28 03:13:53+00', 'Para quem são pequenos campo e monte.
');
VALUES (175, 198, TIMESTAMP WITH TIME ZONE '2019-09-28 10:12:58+00', 'Capacetes estofam, peitos provam,
');

VALUES (176, 177, TIMESTAMP WITH TIME ZONE '2021-01-12 03:13:20+00', 'Que eu torne à minha pátria e Reino amigo,
');
VALUES (176, 177, TIMESTAMP WITH TIME ZONE '2021-01-12 07:07:06+00', 'Na furiosa e dura artilharia,
');
VALUES (176, 437, TIMESTAMP WITH TIME ZONE '2021-01-12 09:29:54+00', 'Defendem a verdura, passeavam
');
VALUES (176, 177, TIMESTAMP WITH TIME ZONE '2021-01-12 14:02:02+00', 'Buscando algum remédio a meus pesares,
');

VALUES (177, 651, TIMESTAMP WITH TIME ZONE '2021-02-10 16:21:48+00', 'Anfitrite, formosa como as flores,
');

VALUES (178, 506, TIMESTAMP WITH TIME ZONE '2018-07-05 11:10:43+00', 'A terra firme foge amedrontado;
');

VALUES (179, 338, TIMESTAMP WITH TIME ZONE '2019-05-03 20:20:05+00', 'O grã progenitor dos Reis primeiros.
');
VALUES (179, 338, TIMESTAMP WITH TIME ZONE '2019-05-04 03:17:39+00', 'A Lei não misturar a casta antiga.
');
VALUES (179, 179, TIMESTAMP WITH TIME ZONE '2019-05-04 03:34:28+00', 'Que o irmão de Lampécia mal guiou,
');

VALUES (180, 196, TIMESTAMP WITH TIME ZONE '2020-10-07 10:43:02+00', 'Que ora acha em ti, promete que conheça
');
VALUES (180, 180, TIMESTAMP WITH TIME ZONE '2020-10-07 15:48:04+00', 'Por tomarmos da terra mantimento.
');
VALUES (180, 180, TIMESTAMP WITH TIME ZONE '2020-10-07 22:17:46+00', 'Os que habitam o Arcturo congelado,
');
VALUES (180, 180, TIMESTAMP WITH TIME ZONE '2020-10-08 06:00:19+00', 'Não pôde resistir à força dura
');

VALUES (181, 180, TIMESTAMP WITH TIME ZONE '2019-01-01 05:36:58+00', 'Noutra parte esculpida estava a guerra,
');
VALUES (181, 381, TIMESTAMP WITH TIME ZONE '2019-01-01 06:47:12+00', 'De cego na alegria bruta, insana,
');
VALUES (181, 180, TIMESTAMP WITH TIME ZONE '2019-01-01 10:14:41+00', 'Todos exprimentados nos perigos
');

VALUES (182, 181, TIMESTAMP WITH TIME ZONE '2021-02-11 13:50:21+00', 'Aqui um globo vêm no ar, que o lume
');
VALUES (182, 487, TIMESTAMP WITH TIME ZONE '2021-02-11 16:45:03+00', 'E por mais segurar-se os Deuses vãos,
');

VALUES (183, 183, TIMESTAMP WITH TIME ZONE '2021-04-05 04:40:21+00', 'Co''o carro de cristal, o claro dia,
');
VALUES (183, 183, TIMESTAMP WITH TIME ZONE '2021-04-05 05:21:52+00', '"Ou foi castigo claro do pecado
');

VALUES (184, 243, TIMESTAMP WITH TIME ZONE '2021-01-29 13:07:21+00', 'Fértil de sorte que outra não lhe iguala.
');
VALUES (184, 183, TIMESTAMP WITH TIME ZONE '2021-01-29 16:24:09+00', 'Que com Lépido e António fez Augusto.
');
VALUES (184, 183, TIMESTAMP WITH TIME ZONE '2021-01-29 23:57:05+00', 'Já fora de tormenta, e dos primeiros
');

VALUES (185, 368, TIMESTAMP WITH TIME ZONE '2019-10-13 13:28:16+00', 'Trazendo fúria e mágoa por antolhos,
');
VALUES (185, 184, TIMESTAMP WITH TIME ZONE '2019-10-13 16:42:11+00', 'O velho Afonso, Príncipe subido,
');
VALUES (185, 368, TIMESTAMP WITH TIME ZONE '2019-10-13 21:07:51+00', 'As armas e os barões assinalados,
');

VALUES (186, 184, TIMESTAMP WITH TIME ZONE '2020-12-26 12:13:59+00', '"Tão temerosa vinha e carregada,
');
VALUES (186, 184, TIMESTAMP WITH TIME ZONE '2020-12-26 15:32:29+00', 'E o princípio do Reino tão potente,
');

VALUES (187, 465, TIMESTAMP WITH TIME ZONE '2020-06-26 02:23:38+00', 'A Júpiter, seu pai, favor pedia
');
VALUES (187, 186, TIMESTAMP WITH TIME ZONE '2020-06-26 02:58:20+00', 'Vos trouxe a cometerdes tal caminho?
');
VALUES (187, 465, TIMESTAMP WITH TIME ZONE '2020-06-26 03:34:10+00', 'Da terra os naturais lhe chamam Gate,
');

VALUES (188, 188, TIMESTAMP WITH TIME ZONE '2019-02-03 03:26:56+00', 'Estarão prometendo a seu senhor;
');
VALUES (188, 638, TIMESTAMP WITH TIME ZONE '2019-02-03 03:34:02+00', 'Para que o Véu dourado combatessem,
');
VALUES (188, 188, TIMESTAMP WITH TIME ZONE '2019-02-03 11:17:49+00', 'Assim recebem junto e dão feridas,
');
VALUES (188, 638, TIMESTAMP WITH TIME ZONE '2019-02-03 17:35:01+00', 'Ao Catual, que dele tinha cargo,
');

VALUES (189, 489, TIMESTAMP WITH TIME ZONE '2019-08-29 02:45:20+00', 'Para lhe descobrir da unida esfera
');
VALUES (189, 489, TIMESTAMP WITH TIME ZONE '2019-08-29 03:53:33+00', 'Qual vermelhas as armas faz de brancas;
');

VALUES (190, 568, TIMESTAMP WITH TIME ZONE '2019-03-22 09:20:15+00', 'Influiu piedosos acidentes
');
VALUES (190, 190, TIMESTAMP WITH TIME ZONE '2019-03-22 10:32:00+00', 'Dos povos de Mombaça pouco humanos.
');
VALUES (190, 568, TIMESTAMP WITH TIME ZONE '2019-03-22 17:38:37+00', '"Chega-se o prazo e dia assinalado
');

VALUES (191, 191, TIMESTAMP WITH TIME ZONE '2019-09-25 15:35:01+00', 'Sempre suspirará por tal aluno.
');
VALUES (191, 272, TIMESTAMP WITH TIME ZONE '2019-09-25 18:25:47+00', 'Que o coração para ele é vaso estreito.
');
VALUES (191, 191, TIMESTAMP WITH TIME ZONE '2019-09-25 21:26:12+00', 'Bem vês como se veste e faz ornado
');

VALUES (192, 460, TIMESTAMP WITH TIME ZONE '2021-02-17 13:09:49+00', 'Há-de fazer nas partes do Oriente.
');

VALUES (193, 345, TIMESTAMP WITH TIME ZONE '2020-11-19 03:14:18+00', 'Dar os Reis inimigos por maridos
');
VALUES (193, 193, TIMESTAMP WITH TIME ZONE '2020-11-19 07:38:30+00', '(Bem como o vento leva branca vela)
');
VALUES (193, 345, TIMESTAMP WITH TIME ZONE '2020-11-19 10:26:52+00', 'As lágrimas lhe alimpa, e acendido
');

VALUES (194, 195, TIMESTAMP WITH TIME ZONE '2020-09-07 07:18:15+00', 'Que tanto os Portugueses engrandece,
');

VALUES (195, 656, TIMESTAMP WITH TIME ZONE '2020-11-03 14:43:14+00', 'Já com esta cidade tão famosa
');

VALUES (196, 354, TIMESTAMP WITH TIME ZONE '2019-10-20 06:30:14+00', 'A casa Santa passa o santo Henrique,
');

VALUES (197, 680, TIMESTAMP WITH TIME ZONE '2020-12-02 17:37:53+00', 'Naquele por quem morro, criarei
');
VALUES (197, 680, TIMESTAMP WITH TIME ZONE '2020-12-02 23:46:37+00', 'Nenhum sinal aqui da Índia achamos
');
VALUES (197, 680, TIMESTAMP WITH TIME ZONE '2020-12-03 02:13:58+00', 'Tenham Religiosos exercícios
');
VALUES (197, 200, TIMESTAMP WITH TIME ZONE '2020-12-03 05:47:00+00', 'Inclinam seu propósito e porfia
');

VALUES (198, 545, TIMESTAMP WITH TIME ZONE '2020-04-15 01:11:23+00', 'Crendo que seu engano estava noto,
');
VALUES (198, 545, TIMESTAMP WITH TIME ZONE '2020-04-15 04:07:45+00', 'A pintura, que fala, querem mal.
');

VALUES (199, 202, TIMESTAMP WITH TIME ZONE '2020-11-12 13:48:24+00', '"Do pecado tiveram sempre a pena
');

VALUES (200, 203, TIMESTAMP WITH TIME ZONE '2020-06-19 03:16:37+00', 'Com que faças o fim a teu desejo."
');
VALUES (200, 430, TIMESTAMP WITH TIME ZONE '2020-06-19 03:49:49+00', '"Contarei, disse, sem que me repreendam
');
VALUES (200, 430, TIMESTAMP WITH TIME ZONE '2020-06-19 08:58:58+00', 'E para o Norte o Emódio cavernoso.
');

VALUES (201, 204, TIMESTAMP WITH TIME ZONE '2020-01-07 22:21:24+00', 'Ou pela vizinhança já teria
');
VALUES (201, 496, TIMESTAMP WITH TIME ZONE '2020-01-07 22:30:41+00', 'Que nunca para o céu fossem viradas,
');
VALUES (201, 496, TIMESTAMP WITH TIME ZONE '2020-01-08 00:49:40+00', 'Perdendo o esforço veio, e bélica arte;
');

VALUES (202, 205, TIMESTAMP WITH TIME ZONE '2019-08-28 00:49:16+00', 'Contra a fera soberba dos Gigantes
');

VALUES (203, 420, TIMESTAMP WITH TIME ZONE '2019-09-29 22:13:36+00', 'Com ele posta em campo já se via;
');
VALUES (203, 206, TIMESTAMP WITH TIME ZONE '2019-09-30 01:00:33+00', 'Se raízes criar lhe não tolheis."
');

VALUES (204, 454, TIMESTAMP WITH TIME ZONE '2020-05-24 20:39:20+00', 'Que, por tomar o alheio, o miserando
');
VALUES (204, 207, TIMESTAMP WITH TIME ZONE '2020-05-24 21:36:48+00', 'Quanto a desesperar já compelidos,
');
VALUES (204, 454, TIMESTAMP WITH TIME ZONE '2020-05-25 03:20:03+00', 'Os Laos, em terra e número potentes;
');

VALUES (205, 207, TIMESTAMP WITH TIME ZONE '2018-09-08 14:00:16+00', 'Que nas asas da Fama se sustenha,
');
VALUES (205, 207, TIMESTAMP WITH TIME ZONE '2018-09-08 15:02:28+00', '"Vedes agora a fraca geração
');
VALUES (205, 207, TIMESTAMP WITH TIME ZONE '2018-09-08 22:20:34+00', '"Não é, disse Veloso, coisa justa
');

VALUES (206, 208, TIMESTAMP WITH TIME ZONE '2019-01-23 23:22:12+00', '"Logo de Macedónia estão as gentes,
');
VALUES (206, 634, TIMESTAMP WITH TIME ZONE '2019-01-24 05:34:28+00', 'Neles ousadamente se subissem;
');
VALUES (206, 634, TIMESTAMP WITH TIME ZONE '2019-01-24 10:30:02+00', 'Porém nem tudo esconde, nem descobre,
');

VALUES (207, 219, TIMESTAMP WITH TIME ZONE '2020-08-22 11:32:17+00', 'Dizia, eis aqui venho oferecido
');

VALUES (208, 389, TIMESTAMP WITH TIME ZONE '2019-08-04 19:34:30+00', 'Agora, da esperança já adquirida,
');
VALUES (208, 389, TIMESTAMP WITH TIME ZONE '2019-08-05 00:51:07+00', 'Que, para se evitar força tamanha,
');
VALUES (208, 389, TIMESTAMP WITH TIME ZONE '2019-08-05 06:45:03+00', 'Que não estimem muito um grande feito.
');

VALUES (209, 231, TIMESTAMP WITH TIME ZONE '2018-06-14 00:32:02+00', 'Que também nele tem curso ordenado
');
VALUES (209, 211, TIMESTAMP WITH TIME ZONE '2018-06-14 08:19:07+00', 'Lhe atalha o poderoso e grão Tonante.
');
VALUES (209, 211, TIMESTAMP WITH TIME ZONE '2018-06-14 14:08:15+00', 'A deixa, e ocasião espera boa
');

VALUES (210, 413, TIMESTAMP WITH TIME ZONE '2019-05-23 00:37:29+00', 'Com longa experiência misturado,
');
VALUES (210, 413, TIMESTAMP WITH TIME ZONE '2019-05-23 01:44:13+00', 'Do sumo sacerdócio a dignidade,
');
VALUES (210, 413, TIMESTAMP WITH TIME ZONE '2019-05-23 07:29:30+00', 'Jactante, mentirosa, e verdadeira,
');
VALUES (210, 212, TIMESTAMP WITH TIME ZONE '2019-05-23 13:02:22+00', 'Por metade das águas Eritreias;
');

VALUES (211, 212, TIMESTAMP WITH TIME ZONE '2020-09-26 17:30:32+00', 'Ali, em cadeiras ricas, cristalinas,
');
VALUES (211, 212, TIMESTAMP WITH TIME ZONE '2020-09-26 17:37:47+00', '--"Deixas criar às portas o inimigo,
');

VALUES (212, 213, TIMESTAMP WITH TIME ZONE '2021-04-16 17:27:58+00', 'De ver isto, que o Mouro lhe contava.
');
VALUES (212, 213, TIMESTAMP WITH TIME ZONE '2021-04-16 23:58:37+00', 'Este é aquele zeloso a quem Deus ama,
');
VALUES (212, 213, TIMESTAMP WITH TIME ZONE '2021-04-17 04:52:18+00', 'Que eu co''o grão Macedónio, e o Romano,
');
VALUES (212, 423, TIMESTAMP WITH TIME ZONE '2021-04-17 10:54:48+00', 'As eternas esposas e fermosas,
');

VALUES (213, 213, TIMESTAMP WITH TIME ZONE '2021-04-02 23:05:49+00', 'Nos não querem deixar viver seguros,
');

VALUES (214, 214, TIMESTAMP WITH TIME ZONE '2019-11-16 01:19:59+00', 'Qual Iopas não soube, ou Demodoco,
');
VALUES (214, 214, TIMESTAMP WITH TIME ZONE '2019-11-16 01:45:25+00', 'Me dês a mim certíssima resposta."
');
VALUES (214, 214, TIMESTAMP WITH TIME ZONE '2019-11-16 03:31:45+00', 'Três formosos outeiros se mostravam
');

VALUES (215, 216, TIMESTAMP WITH TIME ZONE '2020-04-14 22:34:04+00', 'Tal prémio de meus versos me tornassem:
');
VALUES (215, 224, TIMESTAMP WITH TIME ZONE '2020-04-15 02:07:46+00', '"Também movem da guerra as negras fúrias
');
VALUES (215, 216, TIMESTAMP WITH TIME ZONE '2020-04-15 05:37:26+00', 'Não vedes a divina sepultura
');

VALUES (216, 378, TIMESTAMP WITH TIME ZONE '2021-01-19 11:48:28+00', 'Está Tifeu debaixo da alta serra
');
VALUES (216, 218, TIMESTAMP WITH TIME ZONE '2021-01-19 12:10:12+00', 'Uma na paz angélica dourada,
');
VALUES (216, 218, TIMESTAMP WITH TIME ZONE '2021-01-19 12:23:51+00', 'Foi da guarda que tinha, não pequena.
');
VALUES (216, 378, TIMESTAMP WITH TIME ZONE '2021-01-19 15:05:36+00', 'E assim fazendo quanto mal podia,
');

VALUES (217, 426, TIMESTAMP WITH TIME ZONE '2019-12-05 07:32:31+00', 'As lágrimas lhe alimpa, e acendido
');
VALUES (217, 218, TIMESTAMP WITH TIME ZONE '2019-12-05 15:07:35+00', 'Os braços pelo colo lhe lançou,
');
VALUES (217, 426, TIMESTAMP WITH TIME ZONE '2019-12-05 19:23:05+00', 'Está doutro poder que tudo doma.
');
VALUES (217, 218, TIMESTAMP WITH TIME ZONE '2019-12-06 01:25:51+00', 'Salta Nise, Nerine se arremessa
');

VALUES (218, 628, TIMESTAMP WITH TIME ZONE '2020-11-15 06:01:19+00', 'Que vibra os feros raios de Vulcano,
');

VALUES (219, 219, TIMESTAMP WITH TIME ZONE '2020-09-11 07:37:58+00', 'Porque dos feitos grandes, da ousadia
');
VALUES (219, 338, TIMESTAMP WITH TIME ZONE '2020-09-11 14:41:30+00', 'Quando, sem sombra vã de medo ou pejo,
');

VALUES (220, 622, TIMESTAMP WITH TIME ZONE '2020-03-25 17:33:31+00', 'Sendo das mãos lascivas maltratada
');
VALUES (220, 622, TIMESTAMP WITH TIME ZONE '2020-03-25 17:36:10+00', 'Louvar os vossos, como nas estranhas
');

VALUES (221, 220, TIMESTAMP WITH TIME ZONE '2020-10-22 22:07:21+00', 'Malaca por empório ennobrecido,
');

VALUES (222, 222, TIMESTAMP WITH TIME ZONE '2020-01-02 10:09:00+00', 'Pesando-lhe do pouco que lhe pede.
');

VALUES (223, 294, TIMESTAMP WITH TIME ZONE '2018-10-02 21:22:56+00', 'Tanto que estas palavras acabou,
');
VALUES (223, 225, TIMESTAMP WITH TIME ZONE '2018-10-03 04:20:14+00', 'E se o piedoso Eneias navegou
');

VALUES (224, 573, TIMESTAMP WITH TIME ZONE '2019-07-27 20:27:43+00', 'E o Rei ilustre, o peito obediente
');

VALUES (225, 227, TIMESTAMP WITH TIME ZONE '2019-09-20 12:26:42+00', 'Da vossa pertinace confiança;
');
VALUES (225, 674, TIMESTAMP WITH TIME ZONE '2019-09-20 19:54:25+00', 'Diz-lhe a Deusa:--"O transunto, reduzido
');
VALUES (225, 674, TIMESTAMP WITH TIME ZONE '2019-09-20 20:10:09+00', 'As asas ao sereno e sossegado
');
VALUES (225, 674, TIMESTAMP WITH TIME ZONE '2019-09-21 03:45:55+00', 'No número dos Deuses relatado.
');

VALUES (226, 258, TIMESTAMP WITH TIME ZONE '2019-12-25 06:23:04+00', 'Na sexta idade andava enfermo e lento:
');
VALUES (226, 258, TIMESTAMP WITH TIME ZONE '2019-12-25 09:35:31+00', 'Que não for mais que todos excelente.
');
VALUES (226, 258, TIMESTAMP WITH TIME ZONE '2019-12-25 15:22:43+00', 'Quando, quem tudo enfim vencendo andava,
');

VALUES (227, 539, TIMESTAMP WITH TIME ZONE '2018-06-07 10:26:42+00', 'Preso na Egípcia linda e nego pudica.
');
VALUES (227, 539, TIMESTAMP WITH TIME ZONE '2018-06-07 13:48:33+00', 'Quando o Gama, colos seus determinava
');
VALUES (227, 539, TIMESTAMP WITH TIME ZONE '2018-06-07 16:50:54+00', 'Destruídos depois da Grega insânia.
');

VALUES (228, 641, TIMESTAMP WITH TIME ZONE '2020-09-21 04:54:59+00', 'Vendo estas namoradas estranhezas
');
VALUES (228, 641, TIMESTAMP WITH TIME ZONE '2020-09-21 04:57:13+00', 'Mas já o claro amador da Larisséia
');
VALUES (228, 641, TIMESTAMP WITH TIME ZONE '2020-09-21 08:47:32+00', 'Forças d'' homens, de engenhos, de alifantes.
');

VALUES (229, 229, TIMESTAMP WITH TIME ZONE '2020-09-13 18:46:19+00', '"E sendo assim, que o nó desta amizade
');

VALUES (230, 232, TIMESTAMP WITH TIME ZONE '2020-08-13 00:45:07+00', 'O temor grande o sangue lhe resfria.
');
VALUES (230, 313, TIMESTAMP WITH TIME ZONE '2020-08-13 03:15:07+00', 'Que, por armas, tu, Sancho, humildes tinhas.
');
VALUES (230, 232, TIMESTAMP WITH TIME ZONE '2020-08-13 08:24:05+00', 'E já como rendidos lhe obedecem.
');
VALUES (230, 232, TIMESTAMP WITH TIME ZONE '2020-08-13 11:07:41+00', 'Um deles a presença traz cansada,
');

VALUES (231, 561, TIMESTAMP WITH TIME ZONE '2020-06-05 02:29:39+00', 'Que quase todo o mar têm destruído
');
VALUES (231, 234, TIMESTAMP WITH TIME ZONE '2020-06-05 09:40:02+00', 'Pera que com mais alta glória dobre
');

VALUES (232, 234, TIMESTAMP WITH TIME ZONE '2019-11-05 10:26:37+00', 'Ela nos paços logra seus amores,
');
VALUES (232, 461, TIMESTAMP WITH TIME ZONE '2019-11-05 18:14:52+00', 'Aquilo, e os outros todos resistiram.
');

VALUES (233, 238, TIMESTAMP WITH TIME ZONE '2020-04-02 15:41:58+00', 'Da fera multidão quadrupedante.
');

VALUES (234, 239, TIMESTAMP WITH TIME ZONE '2019-08-05 02:08:42+00', 'Vê-lo com pressa já dos seus achado,
');
VALUES (234, 239, TIMESTAMP WITH TIME ZONE '2019-08-05 05:48:19+00', 'Nestas palavras o discreto Gama
');
VALUES (234, 340, TIMESTAMP WITH TIME ZONE '2019-08-05 08:51:58+00', 'Muito para cortar do salso argento;
');

VALUES (235, 240, TIMESTAMP WITH TIME ZONE '2019-11-17 06:29:48+00', 'E nas aves agrestes, que somente
');
VALUES (235, 240, TIMESTAMP WITH TIME ZONE '2019-11-17 08:59:21+00', 'Pensamentos de firme namorado:
');

VALUES (236, 599, TIMESTAMP WITH TIME ZONE '2019-10-27 11:35:36+00', 'Que edificada foste do facundo,
');
VALUES (236, 599, TIMESTAMP WITH TIME ZONE '2019-10-27 13:10:28+00', 'Por céus não naturais, de qualidade
');
VALUES (236, 599, TIMESTAMP WITH TIME ZONE '2019-10-27 14:10:29+00', 'Ou por segredos que homem não conhece,
');
VALUES (236, 599, TIMESTAMP WITH TIME ZONE '2019-10-27 19:30:34+00', 'A ventura, que não no fez vizinho
');

VALUES (237, 241, TIMESTAMP WITH TIME ZONE '2019-12-01 03:24:09+00', 'Assim disse a belíssima Oritia:
');
VALUES (237, 241, TIMESTAMP WITH TIME ZONE '2019-12-01 08:49:11+00', 'E diz que, porque o Sol no mar se esconde,
');
VALUES (237, 636, TIMESTAMP WITH TIME ZONE '2019-12-01 11:03:47+00', 'Os montes Sete Irmãos atroa e abala:
');

VALUES (238, 349, TIMESTAMP WITH TIME ZONE '2020-10-17 16:52:10+00', '"E se de grandes Reinos poderosos
');

VALUES (239, 676, TIMESTAMP WITH TIME ZONE '2020-09-23 17:34:20+00', 'Mas conquistando as ondas do Oceano,
');
VALUES (239, 676, TIMESTAMP WITH TIME ZONE '2020-09-23 22:44:39+00', 'Que mortos pela praia e mar se estendem
');
VALUES (239, 676, TIMESTAMP WITH TIME ZONE '2020-09-24 04:57:03+00', 'Os dois que em gente as pedras converteram.
');

VALUES (240, 243, TIMESTAMP WITH TIME ZONE '2021-02-18 23:53:17+00', 'Que pelejando está co''o Mauritano.
');
VALUES (240, 419, TIMESTAMP WITH TIME ZONE '2021-02-19 01:49:32+00', 'Em Columbo, dos próprios tão temida.
');
VALUES (240, 419, TIMESTAMP WITH TIME ZONE '2021-02-19 02:01:22+00', 'Governa o Mundo todo que sustenta
');

VALUES (241, 243, TIMESTAMP WITH TIME ZONE '2021-01-26 22:56:54+00', 'O corpo fez perder, que teve o Céu;
');
VALUES (241, 243, TIMESTAMP WITH TIME ZONE '2021-01-27 00:24:03+00', 'Com palavras soberbas o arrogante
');

VALUES (242, 244, TIMESTAMP WITH TIME ZONE '2019-05-23 03:30:00+00', 'Co''o Castelhano está, que o Reino pede,
');

VALUES (243, 245, TIMESTAMP WITH TIME ZONE '2021-03-23 06:14:09+00', '"E se inda não ficarem deste jeito
');

VALUES (244, 625, TIMESTAMP WITH TIME ZONE '2021-04-09 08:03:56+00', '"Sublime Rei, a quem do Olimpo puro
');
VALUES (244, 245, TIMESTAMP WITH TIME ZONE '2021-04-09 15:02:00+00', 'De um vulto de Medusa propriamente,
');

VALUES (245, 290, TIMESTAMP WITH TIME ZONE '2021-01-18 18:24:19+00', 'Se nos mostram, que fazem que se atreva
');
VALUES (245, 246, TIMESTAMP WITH TIME ZONE '2021-01-19 01:55:30+00', 'Co''os principais senhores se aconselha,
');
VALUES (245, 246, TIMESTAMP WITH TIME ZONE '2021-01-19 08:58:09+00', 'Das naus o falso Mouro despedido,
');
VALUES (245, 290, TIMESTAMP WITH TIME ZONE '2021-01-19 12:53:45+00', 'Que bem posso escusar trazer escrito
');

VALUES (246, 424, TIMESTAMP WITH TIME ZONE '2018-10-13 15:22:31+00', 'Louvam do Rei os Mouros a bondade,
');

VALUES (247, 689, TIMESTAMP WITH TIME ZONE '2018-11-02 23:10:41+00', 'Não devida o quis pôr no extremo fio."
');
VALUES (247, 689, TIMESTAMP WITH TIME ZONE '2018-11-03 00:29:50+00', 'Que eu canto o peito ilustre Lusitano,
');
VALUES (247, 689, TIMESTAMP WITH TIME ZONE '2018-11-03 03:03:21+00', 'Do sumo sacerdócio a dignidade,
');
VALUES (247, 689, TIMESTAMP WITH TIME ZONE '2018-11-03 03:47:45+00', 'Correu ao mar o Tejo duvidoso;
');

VALUES (248, 248, TIMESTAMP WITH TIME ZONE '2019-05-14 10:08:08+00', 'Para a frota, no seu batel ligeiro.
');
VALUES (248, 248, TIMESTAMP WITH TIME ZONE '2019-05-14 14:04:13+00', 'Levantam nisto os perros o alarido
');
VALUES (248, 586, TIMESTAMP WITH TIME ZONE '2019-05-14 20:07:20+00', 'Da parte de Netuno, que sem conto
');

VALUES (249, 421, TIMESTAMP WITH TIME ZONE '2019-04-20 02:04:05+00', 'Engolindo o corrupto mantimento,
');
VALUES (249, 250, TIMESTAMP WITH TIME ZONE '2019-04-20 02:07:30+00', 'Da gente, nunca de antes dele vista.
');

VALUES (250, 279, TIMESTAMP WITH TIME ZONE '2021-03-27 17:34:15+00', 'Em que estás e serás inda tornado,
');
VALUES (250, 279, TIMESTAMP WITH TIME ZONE '2021-03-27 18:16:20+00', 'Por muros, fogo, lanças e pelouros,
');
VALUES (250, 251, TIMESTAMP WITH TIME ZONE '2021-03-27 18:32:34+00', 'A cor, o gesto estranho, o trajo novo
');
VALUES (250, 251, TIMESTAMP WITH TIME ZONE '2021-03-28 00:20:11+00', 'Tão ásperos os fez, e tão austeros,
');

VALUES (251, 550, TIMESTAMP WITH TIME ZONE '2020-11-09 16:58:23+00', 'Na sua língua cantam concertadas
');

VALUES (252, 305, TIMESTAMP WITH TIME ZONE '2020-12-05 02:38:54+00', 'Assim como a seu pai acontecera
');
VALUES (252, 305, TIMESTAMP WITH TIME ZONE '2020-12-05 10:26:49+00', 'O filho órfão deixava deserdado,
');
VALUES (252, 252, TIMESTAMP WITH TIME ZONE '2020-12-05 11:49:06+00', 'Com que passava Xerxes o Helesponto.
');

VALUES (253, 253, TIMESTAMP WITH TIME ZONE '2019-12-03 04:21:03+00', 'O que no gesto belo se parece,
');
VALUES (253, 253, TIMESTAMP WITH TIME ZONE '2019-12-03 07:26:43+00', 'Das carnes têm grandíssima abstinência;
');
VALUES (253, 253, TIMESTAMP WITH TIME ZONE '2019-12-03 12:56:03+00', 'Mas um só, que Magriço se dizia,
');

VALUES (254, 254, TIMESTAMP WITH TIME ZONE '2019-11-20 03:20:56+00', 'Vê de Cassiopeia a fermosura
');
VALUES (254, 254, TIMESTAMP WITH TIME ZONE '2019-11-20 06:08:14+00', 'Do cárcere fechado os furiosos
');

VALUES (255, 303, TIMESTAMP WITH TIME ZONE '2019-12-20 21:09:43+00', 'Sobre nossas cabeças aparece.
');
VALUES (255, 303, TIMESTAMP WITH TIME ZONE '2019-12-21 04:20:41+00', 'Que as imortalidades que fingia
');
VALUES (255, 303, TIMESTAMP WITH TIME ZONE '2019-12-21 05:16:34+00', 'Verão da desventura grandes modos:
');

VALUES (256, 255, TIMESTAMP WITH TIME ZONE '2020-08-12 14:08:59+00', 'Quem a tamanhas cousas se oferece.
');
VALUES (256, 445, TIMESTAMP WITH TIME ZONE '2020-08-12 18:04:32+00', 'De África tem marítimos assentos,
');

VALUES (257, 497, TIMESTAMP WITH TIME ZONE '2020-05-26 19:51:16+00', 'Mas também diz que a bélica excelência,
');

VALUES (258, 615, TIMESTAMP WITH TIME ZONE '2019-01-31 09:24:50+00', 'Leis em favor do Rei se estabelecem,
');
VALUES (258, 259, TIMESTAMP WITH TIME ZONE '2019-01-31 12:31:25+00', 'Rios de ouro e de prata então correram.
');

VALUES (259, 346, TIMESTAMP WITH TIME ZONE '2020-04-29 10:39:11+00', 'Ouvido tinha aos Fados que viria
');
VALUES (259, 260, TIMESTAMP WITH TIME ZONE '2020-04-29 16:44:45+00', 'Fazendo-a a várias gentes subjugada,
');

VALUES (260, 260, TIMESTAMP WITH TIME ZONE '2020-04-20 22:16:16+00', 'Que a seu costume estava ruminando.
');
VALUES (260, 427, TIMESTAMP WITH TIME ZONE '2020-04-21 03:12:35+00', 'Em vão dos Sarracenos foi cercado,
');

VALUES (261, 622, TIMESTAMP WITH TIME ZONE '2019-05-09 21:29:00+00', 'O coração, que as mágoas lá deixavam;
');
VALUES (261, 261, TIMESTAMP WITH TIME ZONE '2019-05-09 22:55:10+00', 'Poder tirá-lo a terra, com possantes
');
VALUES (261, 261, TIMESTAMP WITH TIME ZONE '2019-05-10 06:24:38+00', '--"Dura inquietação d''alma e da vida,
');
VALUES (261, 622, TIMESTAMP WITH TIME ZONE '2019-05-10 06:26:29+00', 'Pera lhe abalroar as caravelas,
');

VALUES (262, 653, TIMESTAMP WITH TIME ZONE '2019-04-18 22:05:19+00', 'Olhando a cor, o trajo, e a forte armada;
');
VALUES (262, 263, TIMESTAMP WITH TIME ZONE '2019-04-19 01:22:38+00', '"Estas figuras todas que aparecem,
');

VALUES (263, 264, TIMESTAMP WITH TIME ZONE '2020-07-10 04:59:10+00', 'Tanta necessidade avorrecida!
');
VALUES (263, 264, TIMESTAMP WITH TIME ZONE '2020-07-10 05:31:12+00', 'De ouro, e de seda e de algodão tecida.
');

VALUES (264, 264, TIMESTAMP WITH TIME ZONE '2020-12-01 00:12:08+00', 'E propõe-lhe as figuras da visão;
');
VALUES (264, 264, TIMESTAMP WITH TIME ZONE '2020-12-01 05:33:10+00', 'Não valerá dos homens resistência,
');
VALUES (264, 264, TIMESTAMP WITH TIME ZONE '2020-12-01 07:56:14+00', 'A dar à bomba; e, tanto que chegaram,
');

VALUES (265, 634, TIMESTAMP WITH TIME ZONE '2019-09-22 00:02:31+00', 'Tomar ao Mouro forte e guarnecido
');
VALUES (265, 265, TIMESTAMP WITH TIME ZONE '2019-09-22 04:21:18+00', 'De vários orbes, que a Divina verga
');
VALUES (265, 265, TIMESTAMP WITH TIME ZONE '2019-09-22 09:28:22+00', 'Já lhe obedece toda a Estremadura,
');
VALUES (265, 634, TIMESTAMP WITH TIME ZONE '2019-09-22 09:54:28+00', 'Decanis, Oriás, que a esperança
');

VALUES (266, 265, TIMESTAMP WITH TIME ZONE '2019-10-24 00:21:05+00', 'Nem as ervas do campo bem lhe abastam:
');
VALUES (266, 362, TIMESTAMP WITH TIME ZONE '2019-10-24 05:00:39+00', '"Por aqui rodeando a larga parte
');
VALUES (266, 362, TIMESTAMP WITH TIME ZONE '2019-10-24 12:04:05+00', 'E da vontade em ti sobre isto posta
');

VALUES (267, 365, TIMESTAMP WITH TIME ZONE '2019-09-25 13:15:13+00', 'As partes tão remotas onde estamos,
');
VALUES (267, 266, TIMESTAMP WITH TIME ZONE '2019-09-25 21:15:01+00', 'Entrando o mensageiro pelo rio,
');

VALUES (268, 267, TIMESTAMP WITH TIME ZONE '2020-02-12 11:09:47+00', 'Com que, com minha honra, escuse o dano."
');
VALUES (268, 673, TIMESTAMP WITH TIME ZONE '2020-02-12 16:53:59+00', 'No céu vendo e na terra as mesmas cores,
');
VALUES (268, 673, TIMESTAMP WITH TIME ZONE '2020-02-12 22:36:27+00', 'A seu filho, por cuja potestade
');
VALUES (268, 267, TIMESTAMP WITH TIME ZONE '2020-02-12 22:47:51+00', '"Também vem lá do Reino de Toledo,
');

VALUES (269, 328, TIMESTAMP WITH TIME ZONE '2019-02-28 02:09:59+00', 'Que és de peito sincero, humano e raro.
');

VALUES (270, 269, TIMESTAMP WITH TIME ZONE '2020-11-15 06:29:36+00', 'Depois que quis o Padre onipotente
');
VALUES (270, 269, TIMESTAMP WITH TIME ZONE '2020-11-15 07:40:24+00', 'De mostras, que tão certas pareciam.
');
VALUES (270, 269, TIMESTAMP WITH TIME ZONE '2020-11-15 14:56:06+00', '"Esta é a ditosa pátria minha amada,
');

VALUES (271, 359, TIMESTAMP WITH TIME ZONE '2020-11-26 01:26:52+00', 'No ar lascivos beijos se vão dando.
');
VALUES (271, 359, TIMESTAMP WITH TIME ZONE '2020-11-26 04:15:18+00', 'Natura fez cruel de nascimento,
');
VALUES (271, 359, TIMESTAMP WITH TIME ZONE '2020-11-26 08:39:31+00', 'Se não és pera dar-lhe honroso estado,
');

VALUES (272, 417, TIMESTAMP WITH TIME ZONE '2021-04-16 13:01:10+00', 'A vós, e a mi, e o mundo todo doma;
');
VALUES (272, 417, TIMESTAMP WITH TIME ZONE '2021-04-16 15:42:20+00', 'Entre as gentes deixar de si memória
');

VALUES (273, 529, TIMESTAMP WITH TIME ZONE '2018-11-30 02:48:10+00', 'Para a garcenha ou pata conhecida,
');
VALUES (273, 529, TIMESTAMP WITH TIME ZONE '2018-11-30 03:22:34+00', 'Nem se sabe ainda, não, te afirmo e asselo,
');
VALUES (273, 529, TIMESTAMP WITH TIME ZONE '2018-11-30 09:06:50+00', 'Nomes de mil nações, nunca sabidas:
');
VALUES (273, 271, TIMESTAMP WITH TIME ZONE '2018-11-30 11:28:17+00', 'Terra que Anteu num tempo possuiu,
');

VALUES (274, 273, TIMESTAMP WITH TIME ZONE '2020-10-02 21:26:16+00', 'Sempre alcançou favor do Céu sereno.
');
VALUES (274, 343, TIMESTAMP WITH TIME ZONE '2020-10-03 05:09:31+00', 'Que primeiro desejos o acabaram.
');
VALUES (274, 343, TIMESTAMP WITH TIME ZONE '2020-10-03 10:57:08+00', 'Da tempestade horrífica e importuna,
');
VALUES (274, 343, TIMESTAMP WITH TIME ZONE '2020-10-03 14:48:15+00', 'Como dama que foi do incauto amante
');

VALUES (275, 274, TIMESTAMP WITH TIME ZONE '2021-04-27 23:19:40+00', 'Bóreas injuriado, e o companheiro
');
VALUES (275, 330, TIMESTAMP WITH TIME ZONE '2021-04-27 23:30:58+00', 'E António vencedor, sem companheiro,
');
VALUES (275, 330, TIMESTAMP WITH TIME ZONE '2021-04-28 06:08:48+00', 'Como se aqui os trabalhos se acabassem;
');
VALUES (275, 274, TIMESTAMP WITH TIME ZONE '2021-04-28 10:48:31+00', 'De Mauritânia os montes e lugares,
');

VALUES (276, 591, TIMESTAMP WITH TIME ZONE '2021-03-27 07:24:09+00', 'Estando fora da água incautamente,
');
VALUES (276, 274, TIMESTAMP WITH TIME ZONE '2021-03-27 12:40:32+00', 'Melique, porque à força só de espada
');
VALUES (276, 591, TIMESTAMP WITH TIME ZONE '2021-03-27 16:16:12+00', 'C''um poder tão singelo e tão pequeno,
');

VALUES (277, 275, TIMESTAMP WITH TIME ZONE '2018-03-26 16:15:20+00', 'Trabalho ilustre, duro e esclarecido,
');
VALUES (277, 524, TIMESTAMP WITH TIME ZONE '2018-03-26 23:35:54+00', 'Que, só pera abalar-se, nada abasta;
');
VALUES (277, 275, TIMESTAMP WITH TIME ZONE '2018-03-27 05:01:42+00', 'Começa o reino Ormuz, que todo se anda
');

VALUES (278, 454, TIMESTAMP WITH TIME ZONE '2020-09-20 03:40:09+00', 'A qual Coulão, a qual dá Cranganor,
');
VALUES (278, 454, TIMESTAMP WITH TIME ZONE '2020-09-20 04:51:15+00', 'Lugares, que ganhara o pátrio Marte;
');
VALUES (278, 454, TIMESTAMP WITH TIME ZONE '2020-09-20 09:33:55+00', 'Mais avante bebendo seca o rio
');

VALUES (279, 411, TIMESTAMP WITH TIME ZONE '2020-08-24 23:04:09+00', 'Desbaratareis tudo o que quiserdes,
');
VALUES (279, 278, TIMESTAMP WITH TIME ZONE '2020-08-24 23:06:52+00', '"Passadas tendo já as Canárias ilhas,
');
VALUES (279, 411, TIMESTAMP WITH TIME ZONE '2020-08-25 00:40:10+00', 'Aquele monte, os negros de quem falo,
');

VALUES (280, 279, TIMESTAMP WITH TIME ZONE '2021-04-15 23:16:53+00', 'Os belicosos ânimos, que inflama:
');
VALUES (280, 536, TIMESTAMP WITH TIME ZONE '2021-04-15 23:52:16+00', 'Com cujo braço o Mouro inimigo doma,
');
VALUES (280, 536, TIMESTAMP WITH TIME ZONE '2021-04-16 06:39:40+00', 'Todo o valor, primeiro se assinala:
');
VALUES (280, 536, TIMESTAMP WITH TIME ZONE '2021-04-16 11:32:46+00', 'Nem que ninguém comigo possa mais,
');

VALUES (281, 368, TIMESTAMP WITH TIME ZONE '2021-03-11 06:20:49+00', 'Que vêm de descobrir o novo mundo,
');
VALUES (281, 368, TIMESTAMP WITH TIME ZONE '2021-03-11 11:15:48+00', 'Do Douro o Guadiana o campo ufano,
');

VALUES (282, 280, TIMESTAMP WITH TIME ZONE '2020-12-10 14:32:45+00', 'Floresce o filho e neto de Ciniras,
');
VALUES (282, 280, TIMESTAMP WITH TIME ZONE '2020-12-10 19:32:02+00', 'O grande Capitão chamar mandava,
');
VALUES (282, 280, TIMESTAMP WITH TIME ZONE '2020-12-11 01:14:23+00', '--"Sabe que quantas naus esta viagem
');

VALUES (283, 280, TIMESTAMP WITH TIME ZONE '2020-03-17 23:36:26+00', 'Encomendado ao sacro Nicolau,
');
VALUES (283, 522, TIMESTAMP WITH TIME ZONE '2020-03-18 02:31:44+00', 'Por sinais diabólicos e indícios,
');
VALUES (283, 280, TIMESTAMP WITH TIME ZONE '2020-03-18 08:39:57+00', 'Que nas mãos inimigas entregar-se.
');

VALUES (284, 282, TIMESTAMP WITH TIME ZONE '2021-04-13 18:52:39+00', 'Mostrar-lhe a formosura de Diana;
');
VALUES (284, 468, TIMESTAMP WITH TIME ZONE '2021-04-13 19:22:34+00', 'Responde-lhe do ramo filomela;
');
VALUES (284, 468, TIMESTAMP WITH TIME ZONE '2021-04-14 00:11:10+00', 'Que a mais obriga amor mal empregado.
');
VALUES (284, 468, TIMESTAMP WITH TIME ZONE '2021-04-14 04:32:44+00', 'Cos títulos de Conde e d''honras nobres
');

VALUES (285, 283, TIMESTAMP WITH TIME ZONE '2019-07-24 20:03:17+00', 'Que com tanto temor buscando vinha,
');
VALUES (285, 435, TIMESTAMP WITH TIME ZONE '2019-07-25 03:35:25+00', 'De quantos bebem a água de Parnaso.
');

VALUES (286, 283, TIMESTAMP WITH TIME ZONE '2018-06-02 05:29:42+00', 'Mais e mais a tormenta acrescentavam
');
VALUES (286, 283, TIMESTAMP WITH TIME ZONE '2018-06-02 10:43:23+00', 'Que só para este efeito já trazia;
');
VALUES (286, 491, TIMESTAMP WITH TIME ZONE '2018-06-02 10:52:25+00', 'Com as asas nos pés à Terra desce;
');

VALUES (287, 375, TIMESTAMP WITH TIME ZONE '2020-10-08 22:26:02+00', 'Mas não deixes no mar as Ilhas onde
');

VALUES (288, 361, TIMESTAMP WITH TIME ZONE '2021-03-19 17:49:03+00', 'De África as terras, e do Oriente os marços,
');
VALUES (288, 285, TIMESTAMP WITH TIME ZONE '2021-03-19 22:03:51+00', 'Dinos todos de fama e maravilha,
');
VALUES (288, 361, TIMESTAMP WITH TIME ZONE '2021-03-20 03:53:03+00', 'Como da seva mesa de Tiestes,
');
VALUES (288, 285, TIMESTAMP WITH TIME ZONE '2021-03-20 06:47:43+00', 'Mas deixa os feitos seus inexplicáveis,
');

VALUES (289, 285, TIMESTAMP WITH TIME ZONE '2021-04-17 03:10:45+00', 'Que pôde sustentar o grande peso
');
VALUES (289, 467, TIMESTAMP WITH TIME ZONE '2021-04-17 04:41:17+00', 'Sujeita a feminino senhorio
');
VALUES (289, 285, TIMESTAMP WITH TIME ZONE '2021-04-17 07:09:16+00', 'Que apenas nos meus olhos ponho o freio.
');

VALUES (290, 286, TIMESTAMP WITH TIME ZONE '2019-12-24 23:16:04+00', 'Determinadamente se lançavam:
');

VALUES (291, 288, TIMESTAMP WITH TIME ZONE '2020-03-15 17:11:50+00', 'Feitos farão tão dinos de memória
');
VALUES (291, 288, TIMESTAMP WITH TIME ZONE '2020-03-15 20:43:53+00', 'O arraial soberbo e belicoso,
');
VALUES (291, 288, TIMESTAMP WITH TIME ZONE '2020-03-15 23:49:44+00', 'O padre Baco ali não consentia
');

VALUES (292, 584, TIMESTAMP WITH TIME ZONE '2020-04-30 22:51:40+00', 'Sem força, de covarde e de apressado,
');

VALUES (293, 619, TIMESTAMP WITH TIME ZONE '2020-01-17 00:49:33+00', 'Como que pronto está para afeitar-se,
');

VALUES (294, 678, TIMESTAMP WITH TIME ZONE '2019-10-26 10:53:23+00', 'Que lhe comete o Rei dos Lusitanos.
');
VALUES (294, 290, TIMESTAMP WITH TIME ZONE '2019-10-26 17:13:20+00', 'A ferro, a fogo, a setas e pelouros,
');
VALUES (294, 290, TIMESTAMP WITH TIME ZONE '2019-10-27 00:35:53+00', 'Podendo o temor mais, gelado, inerte,
');
VALUES (294, 678, TIMESTAMP WITH TIME ZONE '2019-10-27 01:24:22+00', 'Que de desconfiança não se afronte,
');

VALUES (295, 292, TIMESTAMP WITH TIME ZONE '2019-03-28 15:32:57+00', 'Vencestes esta gente tão guerreira?
');

VALUES (296, 638, TIMESTAMP WITH TIME ZONE '2018-10-02 04:42:15+00', 'Rotos? mas antes mortos, maravilha
');
VALUES (296, 294, TIMESTAMP WITH TIME ZONE '2018-10-02 10:32:48+00', 'Com que, com minha honra, escuse o dano."
');
VALUES (296, 294, TIMESTAMP WITH TIME ZONE '2018-10-02 13:13:11+00', 'De Meca as naus, que as suas desfizessem.
');

VALUES (297, 295, TIMESTAMP WITH TIME ZONE '2020-04-10 06:44:35+00', 'A gente da cor era verdadeira,
');
VALUES (297, 295, TIMESTAMP WITH TIME ZONE '2020-04-10 14:26:04+00', 'Quando nela ganharam a coroa
');
VALUES (297, 326, TIMESTAMP WITH TIME ZONE '2020-04-10 18:42:34+00', 'Desculpado por certo está Fernando,
');
VALUES (297, 295, TIMESTAMP WITH TIME ZONE '2020-04-11 01:31:46+00', '"Viu ser cativo o santo irmão Fernando,
');

VALUES (298, 296, TIMESTAMP WITH TIME ZONE '2019-12-05 11:08:09+00', 'Põe-se a Deusa com outras em direito
');
VALUES (298, 410, TIMESTAMP WITH TIME ZONE '2019-12-05 17:26:23+00', 'Avante passa, e lá no sexto Céu,
');

VALUES (299, 392, TIMESTAMP WITH TIME ZONE '2020-05-20 17:28:20+00', 'Que trazia, com força, já tocava;
');

VALUES (300, 683, TIMESTAMP WITH TIME ZONE '2019-07-24 08:25:43+00', 'A sua falsidade acomodadas,
');
VALUES (300, 297, TIMESTAMP WITH TIME ZONE '2019-07-24 08:40:46+00', 'Aquilo que tão mal o Rei cuidava,
');
VALUES (300, 297, TIMESTAMP WITH TIME ZONE '2019-07-24 11:48:06+00', 'Se também com tais obras nos engana
');
VALUES (300, 297, TIMESTAMP WITH TIME ZONE '2019-07-24 11:57:36+00', 'Vejo um estranho vir de pele preta,
');

VALUES (301, 646, TIMESTAMP WITH TIME ZONE '2018-10-19 05:33:21+00', 'Nem haverá, se este costume dura,
');
VALUES (301, 646, TIMESTAMP WITH TIME ZONE '2018-10-19 13:26:25+00', 'Posto que em força e gente tão pequeno.
');
VALUES (301, 298, TIMESTAMP WITH TIME ZONE '2018-10-19 15:53:22+00', 'Homens verá, da terra ali vizinha;
');

VALUES (302, 503, TIMESTAMP WITH TIME ZONE '2018-11-27 02:56:49+00', 'Mas já a amorosa estrela cintilava
');
VALUES (302, 503, TIMESTAMP WITH TIME ZONE '2018-11-27 09:40:54+00', 'Se lá no reino escuro de Sumano
');
VALUES (302, 298, TIMESTAMP WITH TIME ZONE '2018-11-27 14:53:39+00', 'Destes arrenegados muitos são
');
VALUES (302, 298, TIMESTAMP WITH TIME ZONE '2018-11-27 19:23:37+00', 'Andam nus, e somente um pano cobre
');

VALUES (303, 299, TIMESTAMP WITH TIME ZONE '2020-05-06 16:19:47+00', 'Não mostra quanto pode, e com razão,
');
VALUES (303, 299, TIMESTAMP WITH TIME ZONE '2020-05-06 20:07:52+00', 'E segundo o que a todos pareceu,
');
VALUES (303, 456, TIMESTAMP WITH TIME ZONE '2020-05-07 02:26:34+00', 'Mostrando-lhe as amadas Ninfas belas,
');

VALUES (304, 299, TIMESTAMP WITH TIME ZONE '2020-10-20 01:31:52+00', 'De áspero mato e de espessura brava.
');
VALUES (304, 440, TIMESTAMP WITH TIME ZONE '2020-10-20 04:50:46+00', 'Se fia da infiel e falsa gente.
');
VALUES (304, 440, TIMESTAMP WITH TIME ZONE '2020-10-20 06:10:27+00', 'Outra vez cometendo os duros medos
');
VALUES (304, 299, TIMESTAMP WITH TIME ZONE '2020-10-20 10:05:26+00', 'Por que is aventurar ao mar iroso
');

VALUES (305, 301, TIMESTAMP WITH TIME ZONE '2020-05-14 00:33:26+00', 'Foi nos campos Tartésios ajuntada.
');
VALUES (305, 582, TIMESTAMP WITH TIME ZONE '2020-05-14 01:50:46+00', '"Muitos também do vulgo vil sem nome
');
VALUES (305, 582, TIMESTAMP WITH TIME ZONE '2020-05-14 02:08:24+00', 'Se já não pões a tanta insânia freio,
');
VALUES (305, 582, TIMESTAMP WITH TIME ZONE '2020-05-14 04:03:24+00', 'Morrem banhados, tendo por certeza
');

VALUES (306, 590, TIMESTAMP WITH TIME ZONE '2021-01-17 04:21:53+00', 'Que os Melindanos têm tão rudo peito,
');

VALUES (307, 580, TIMESTAMP WITH TIME ZONE '2020-10-22 08:05:43+00', 'Futuro sua partida diferisse.
');
VALUES (307, 304, TIMESTAMP WITH TIME ZONE '2020-10-22 11:54:24+00', 'A boca e os olhos negros retorcendo,
');

VALUES (308, 306, TIMESTAMP WITH TIME ZONE '2020-07-31 11:00:13+00', 'Insiste o Malabar em tê-lo preso,
');
VALUES (308, 589, TIMESTAMP WITH TIME ZONE '2020-07-31 12:57:18+00', 'Nelas sós exprimenta toda a sorte
');
VALUES (308, 589, TIMESTAMP WITH TIME ZONE '2020-07-31 19:33:01+00', 'Com mais furor o mar do que costuma.
');
VALUES (308, 306, TIMESTAMP WITH TIME ZONE '2020-08-01 01:20:20+00', 'Começam novas forças a ir tomando,
');

VALUES (309, 306, TIMESTAMP WITH TIME ZONE '2018-11-26 18:01:01+00', 'Só pode o que impossível parecia:
');
VALUES (309, 306, TIMESTAMP WITH TIME ZONE '2018-11-26 18:06:37+00', 'Quando o poder do Mauro grande e horrendo
');
VALUES (309, 306, TIMESTAMP WITH TIME ZONE '2018-11-26 22:44:37+00', 'Cale-se de Alexandro e de Trajano
');
VALUES (309, 689, TIMESTAMP WITH TIME ZONE '2018-11-27 01:44:20+00', 'Peras piramidais, viver quiserdes,
');

VALUES (310, 624, TIMESTAMP WITH TIME ZONE '2019-04-03 19:34:46+00', 'Tanto enlevas a leve fantasia,
');
VALUES (310, 308, TIMESTAMP WITH TIME ZONE '2019-04-04 01:18:18+00', 'Não contra o soberbíssimo Otomano,
');

VALUES (311, 676, TIMESTAMP WITH TIME ZONE '2020-08-20 16:17:32+00', 'Na mísera mãe postos, que endoudece,
');
VALUES (311, 676, TIMESTAMP WITH TIME ZONE '2020-08-20 17:52:01+00', 'Mais (depois de viúva) manifesta.
');
VALUES (311, 676, TIMESTAMP WITH TIME ZONE '2020-08-21 00:04:59+00', 'Quanto mais pode a Fé que a força humana:
');
VALUES (311, 676, TIMESTAMP WITH TIME ZONE '2020-08-21 04:05:34+00', 'Nas armas e na paz, da gente estranha
');

VALUES (312, 310, TIMESTAMP WITH TIME ZONE '2021-02-20 15:53:27+00', 'Não tarda muito o Príncipe ditoso
');

VALUES (313, 452, TIMESTAMP WITH TIME ZONE '2019-12-05 13:08:41+00', 'Araspas, de Panteia, em fogo ardente,
');
VALUES (313, 452, TIMESTAMP WITH TIME ZONE '2019-12-05 16:38:22+00', 'Descendo pelos ásperos outeiros,
');
VALUES (313, 312, TIMESTAMP WITH TIME ZONE '2019-12-05 20:55:41+00', 'Dizendo: "Fuge, fuge, Lusitano,
');
VALUES (313, 452, TIMESTAMP WITH TIME ZONE '2019-12-06 03:11:08+00', 'Tem o Galego cauto, e o grande e raro
');

VALUES (314, 341, TIMESTAMP WITH TIME ZONE '2019-07-28 06:01:04+00', '"Olha aquele que desce pela lança?
');
VALUES (314, 312, TIMESTAMP WITH TIME ZONE '2019-07-28 09:14:02+00', 'Quereis que com as velas leve o vento?"--
');
VALUES (314, 341, TIMESTAMP WITH TIME ZONE '2019-07-28 14:04:15+00', 'No gesto natural se converteu
');

VALUES (315, 568, TIMESTAMP WITH TIME ZONE '2019-02-26 13:27:33+00', 'Tomou mais a conquista do mar largo.
');
VALUES (315, 313, TIMESTAMP WITH TIME ZONE '2019-02-26 13:58:26+00', 'Mas porém, quando as gentes Mauritanas,
');
VALUES (315, 313, TIMESTAMP WITH TIME ZONE '2019-02-26 18:01:51+00', 'Dizendo: "Fuge, fuge, Lusitano,
');
VALUES (315, 568, TIMESTAMP WITH TIME ZONE '2019-02-26 22:15:41+00', 'Vizinha fez de meu paterno ninho,
');

VALUES (316, 377, TIMESTAMP WITH TIME ZONE '2019-01-17 07:14:13+00', 'Ver-me-ás dele e do Reino ser privada,
');
VALUES (316, 313, TIMESTAMP WITH TIME ZONE '2019-01-17 13:03:30+00', 'Porém não que perdesse a esperança
');
VALUES (316, 313, TIMESTAMP WITH TIME ZONE '2019-01-17 14:03:21+00', 'Nem o mancebo Cocles dos Ausónios,
');
VALUES (316, 377, TIMESTAMP WITH TIME ZONE '2019-01-17 17:08:26+00', '"Enfim que nesta incógnita espessura
');

VALUES (317, 431, TIMESTAMP WITH TIME ZONE '2019-02-07 12:00:14+00', 'Armas, cavalo, ao bélico serviço.
');

VALUES (318, 635, TIMESTAMP WITH TIME ZONE '2020-06-02 18:37:46+00', 'Que ela dos olhos seus regadas tinha,
');
VALUES (318, 635, TIMESTAMP WITH TIME ZONE '2020-06-03 01:57:30+00', 'Deuses o sacro verso está chamando,
');
VALUES (318, 635, TIMESTAMP WITH TIME ZONE '2020-06-03 08:14:43+00', 'Por quem só doces sombras apresenta,
');

VALUES (319, 317, TIMESTAMP WITH TIME ZONE '2019-05-07 11:03:00+00', 'De ver eousas estranhas desejosa
');

VALUES (320, 419, TIMESTAMP WITH TIME ZONE '2020-12-19 21:05:18+00', 'Muda quaisquer propósitos tomados,
');

VALUES (321, 318, TIMESTAMP WITH TIME ZONE '2020-07-11 16:09:29+00', 'Trajo, sair da grande armada nova,
');
VALUES (321, 318, TIMESTAMP WITH TIME ZONE '2020-07-11 17:13:47+00', 'As mulheres c''um choro piedoso,
');
VALUES (321, 318, TIMESTAMP WITH TIME ZONE '2020-07-11 22:18:45+00', 'Por roubar-lhe as fazendas cobiçadas;
');
VALUES (321, 318, TIMESTAMP WITH TIME ZONE '2020-07-12 04:38:50+00', 'Rompendo pelo céu a mãe formosa
');

VALUES (322, 693, TIMESTAMP WITH TIME ZONE '2019-07-22 10:38:48+00', 'Vê que esses que frequentam os reais
');
VALUES (322, 693, TIMESTAMP WITH TIME ZONE '2019-07-22 16:39:37+00', 'Tão cega fica, quanto ficareis,
');
VALUES (322, 319, TIMESTAMP WITH TIME ZONE '2019-07-22 18:22:41+00', 'A subidos e ilustres movimentos:
');
VALUES (322, 319, TIMESTAMP WITH TIME ZONE '2019-07-22 18:52:16+00', 'Desta arte o Português enfim castiga
');

VALUES (323, 641, TIMESTAMP WITH TIME ZONE '2020-12-15 15:36:12+00', 'Perdão alcançarás da culpa tua.
');

VALUES (324, 489, TIMESTAMP WITH TIME ZONE '2020-08-17 05:42:04+00', 'Das perlas de Barém tributo rico.
');
VALUES (324, 322, TIMESTAMP WITH TIME ZONE '2020-08-17 05:46:16+00', 'Por quem sua vinda ao Rei manifestaram.
');
VALUES (324, 489, TIMESTAMP WITH TIME ZONE '2020-08-17 09:01:16+00', 'O mortífero engano, assim dizia:
');

VALUES (325, 322, TIMESTAMP WITH TIME ZONE '2020-09-19 00:28:32+00', 'Em si verá Beadala o Márcio jogo.
');

VALUES (326, 326, TIMESTAMP WITH TIME ZONE '2020-02-18 18:36:49+00', 'Dizei: se sois mandados, como estais
');
VALUES (326, 625, TIMESTAMP WITH TIME ZONE '2020-02-19 02:28:34+00', 'Mas, se lho o regimento não consente,
');
VALUES (326, 625, TIMESTAMP WITH TIME ZONE '2020-02-19 05:30:16+00', 'Que eles, em campo raso ou estacada,
');

VALUES (327, 528, TIMESTAMP WITH TIME ZONE '2021-04-08 21:44:06+00', 'Dando-lhe a entender que ali viera
');
VALUES (327, 528, TIMESTAMP WITH TIME ZONE '2021-04-09 01:44:55+00', 'Se vingam só do peito que as comete;
');
VALUES (327, 326, TIMESTAMP WITH TIME ZONE '2021-04-09 05:07:03+00', 'Dos imigos, gritando o céu tocavam,
');
VALUES (327, 326, TIMESTAMP WITH TIME ZONE '2021-04-09 12:59:04+00', 'E quase o Reino todo reformou
');

VALUES (328, 543, TIMESTAMP WITH TIME ZONE '2019-04-07 07:24:44+00', 'Contra irmãos e parentes (caso estranho!)
');
VALUES (328, 327, TIMESTAMP WITH TIME ZONE '2019-04-07 11:38:13+00', 'Tantas terras, por ver segredos delas,
');

VALUES (329, 376, TIMESTAMP WITH TIME ZONE '2019-03-12 01:23:39+00', 'No roubador de Europa a luz Febeia,
');
VALUES (329, 327, TIMESTAMP WITH TIME ZONE '2019-03-12 08:15:29+00', 'A deixa, e ocasião espera boa
');

VALUES (330, 328, TIMESTAMP WITH TIME ZONE '2018-09-14 22:25:11+00', 'Sem Rei, sem leis humanas ou divinas
');
VALUES (330, 328, TIMESTAMP WITH TIME ZONE '2018-09-15 01:11:56+00', 'O Gama, que o danado peito encerra,
');
VALUES (330, 328, TIMESTAMP WITH TIME ZONE '2018-09-15 03:32:52+00', 'Em castigar os feitos inumanos
');
VALUES (330, 328, TIMESTAMP WITH TIME ZONE '2018-09-15 05:02:41+00', 'E despois, junto ao Cabo Comorim,
');

VALUES (331, 328, TIMESTAMP WITH TIME ZONE '2020-01-15 17:04:42+00', '"Além disso, o que a tudo enfim me obriga,
');
VALUES (331, 437, TIMESTAMP WITH TIME ZONE '2020-01-15 22:26:27+00', 'Que em lança de aço torna o Bago de ouro.
');
VALUES (331, 437, TIMESTAMP WITH TIME ZONE '2020-01-16 05:35:51+00', 'Sem que ache resistência nem perigos,
');
VALUES (331, 328, TIMESTAMP WITH TIME ZONE '2020-01-16 09:00:58+00', 'Tudo aquilo obedece, que criaste,
');

VALUES (332, 329, TIMESTAMP WITH TIME ZONE '2021-02-20 19:49:06+00', 'Principalmente aqui, que sou chegado
');
VALUES (332, 480, TIMESTAMP WITH TIME ZONE '2021-02-20 21:22:30+00', 'Acude e corre, pai, que se não corres,
');

VALUES (333, 619, TIMESTAMP WITH TIME ZONE '2021-02-12 04:05:51+00', 'Levam gritando as âncoras acima,
');

VALUES (334, 330, TIMESTAMP WITH TIME ZONE '2019-01-02 17:36:22+00', 'Vedes, o vosso mar cortando vão,
');
VALUES (334, 549, TIMESTAMP WITH TIME ZONE '2019-01-03 01:14:41+00', 'Que a fortuna não deixa durar muito,
');
VALUES (334, 330, TIMESTAMP WITH TIME ZONE '2019-01-03 07:52:00+00', 'De quem tanto os Troianos se ajudaram,
');
VALUES (334, 330, TIMESTAMP WITH TIME ZONE '2019-01-03 11:31:33+00', 'Como cabeça ali de Europa toda,
');

VALUES (335, 427, TIMESTAMP WITH TIME ZONE '2021-01-05 13:05:04+00', '"Olha de Banda as Ilhas, que se esmaltam
');

VALUES (336, 695, TIMESTAMP WITH TIME ZONE '2020-12-19 06:08:24+00', 'Ver-me-ás dele e do Reino ser privada,
');
VALUES (336, 335, TIMESTAMP WITH TIME ZONE '2020-12-19 11:50:48+00', 'Nem eu consentirei que a excelência
');
VALUES (336, 695, TIMESTAMP WITH TIME ZONE '2020-12-19 17:07:53+00', 'Formosas Ninfas são as que curavam
');

VALUES (337, 337, TIMESTAMP WITH TIME ZONE '2019-06-11 08:15:10+00', 'Do metal que a cor tem do louro Apolo.
');
VALUES (337, 622, TIMESTAMP WITH TIME ZONE '2019-06-11 08:20:55+00', 'Melhor do Rei, que os Maumetanos ama,
');
VALUES (337, 337, TIMESTAMP WITH TIME ZONE '2019-06-11 10:23:35+00', 'Qual o das moças Bíbli e Cinireia,
');

VALUES (338, 463, TIMESTAMP WITH TIME ZONE '2020-11-01 03:49:02+00', 'Vê que já teve o Indo sojugado,
');
VALUES (338, 338, TIMESTAMP WITH TIME ZONE '2020-11-01 07:26:40+00', 'Jugo perpétuo, eterno cativeiro,
');

VALUES (339, 600, TIMESTAMP WITH TIME ZONE '2019-05-02 11:31:49+00', 'Esquadrão de Gentios e de Mouros.
');

VALUES (340, 622, TIMESTAMP WITH TIME ZONE '2021-03-24 20:07:28+00', 'Assim a formosa e a forte companhia
');

VALUES (341, 663, TIMESTAMP WITH TIME ZONE '2021-03-02 14:11:35+00', 'O nome do seu Pedro, que lhe ouvistes,
');
VALUES (341, 663, TIMESTAMP WITH TIME ZONE '2021-03-02 18:01:21+00', 'Lá quase junto donde o Sol ardendo
');
VALUES (341, 339, TIMESTAMP WITH TIME ZONE '2021-03-02 20:19:56+00', 'Dois invernos fazendo e dois verões,
');
VALUES (341, 339, TIMESTAMP WITH TIME ZONE '2021-03-02 23:05:52+00', 'Que da ocidental praia Lusitana,
');

VALUES (342, 642, TIMESTAMP WITH TIME ZONE '2021-03-15 16:31:49+00', 'Que em tal idade é suma de excelência.
');

VALUES (343, 343, TIMESTAMP WITH TIME ZONE '2020-11-05 19:48:43+00', 'Torna para detrás a nau forçada,
');

VALUES (344, 344, TIMESTAMP WITH TIME ZONE '2019-09-30 10:04:05+00', 'Trazidos lá do Atlântico tesouro.
');
VALUES (344, 365, TIMESTAMP WITH TIME ZONE '2019-09-30 10:15:27+00', 'Sofrendo morte injusta e insofríbil,
');
VALUES (344, 365, TIMESTAMP WITH TIME ZONE '2019-09-30 18:06:23+00', 'A guerra com que a pátria se sustinha;
');
VALUES (344, 344, TIMESTAMP WITH TIME ZONE '2019-09-30 21:56:11+00', 'Que com o Tebano tinha assento igual.
');

VALUES (345, 345, TIMESTAMP WITH TIME ZONE '2020-11-24 00:54:35+00', 'Da gente, nunca de antes dele vista.
');
VALUES (345, 345, TIMESTAMP WITH TIME ZONE '2020-11-24 06:35:41+00', 'Tudo o Mouro contente bem recebe;
');

VALUES (346, 345, TIMESTAMP WITH TIME ZONE '2020-10-15 12:49:25+00', 'Que a tanto o engenho humano não se estende.
');
VALUES (346, 345, TIMESTAMP WITH TIME ZONE '2020-10-15 20:36:13+00', ' A fazer sabedor o Rei gentio
');

VALUES (347, 346, TIMESTAMP WITH TIME ZONE '2020-08-30 11:13:52+00', 'Do Sul e regiões de abrigo nuas;
');
VALUES (347, 652, TIMESTAMP WITH TIME ZONE '2020-08-30 13:32:02+00', 'Das soberbas e várias gentes dela,
');
VALUES (347, 346, TIMESTAMP WITH TIME ZONE '2020-08-30 16:31:12+00', 'Tethys, e a ilha angélica pintada,
');

VALUES (348, 349, TIMESTAMP WITH TIME ZONE '2020-09-13 11:42:28+00', 'Quer, diante do Rei e dos senhores,
');

VALUES (349, 584, TIMESTAMP WITH TIME ZONE '2020-04-30 00:32:53+00', '"Os casos vi que os rudos marinheiros,
');
VALUES (349, 584, TIMESTAMP WITH TIME ZONE '2020-04-30 03:12:35+00', 'Desprezador das honras e dinheiro,
');
VALUES (349, 584, TIMESTAMP WITH TIME ZONE '2020-04-30 07:01:21+00', 'Por se salvar a gente à costa dava.
');

VALUES (350, 616, TIMESTAMP WITH TIME ZONE '2020-08-02 22:32:27+00', 'De Leiria, que de antes foi tomada
');
VALUES (350, 616, TIMESTAMP WITH TIME ZONE '2020-08-03 06:26:43+00', 'Se, com a experiência, têm bondade
');
VALUES (350, 616, TIMESTAMP WITH TIME ZONE '2020-08-03 06:49:54+00', 'Tens de Neptuno o reino e salsa via,
');

VALUES (351, 353, TIMESTAMP WITH TIME ZONE '2020-07-26 01:48:15+00', 'Outro estrago e vitória clara e bela,
');
VALUES (351, 673, TIMESTAMP WITH TIME ZONE '2020-07-26 04:37:02+00', 'O mundo com os varões, que esforço e arte
');
VALUES (351, 353, TIMESTAMP WITH TIME ZONE '2020-07-26 04:46:37+00', 'Estão pelos telhados e janelas
');

VALUES (352, 354, TIMESTAMP WITH TIME ZONE '2018-06-20 01:14:25+00', 'De Imperador, que sobre os outros mande.
');
VALUES (352, 354, TIMESTAMP WITH TIME ZONE '2018-06-20 02:36:56+00', 'Que perigos, que mortes lhe destinas
');
VALUES (352, 420, TIMESTAMP WITH TIME ZONE '2018-06-20 03:27:53+00', 'Nas ondas velas pôs em seco lenho,
');

VALUES (353, 354, TIMESTAMP WITH TIME ZONE '2020-03-06 22:57:21+00', 'Do torpe Ismaelita cavaleiro,
');
VALUES (353, 619, TIMESTAMP WITH TIME ZONE '2020-03-07 00:37:56+00', 'Para o sumo Poder que a etérea corte
');

VALUES (354, 560, TIMESTAMP WITH TIME ZONE '2020-01-03 22:04:10+00', 'Ajunta também Mafra, em pouco espaço,
');
VALUES (354, 560, TIMESTAMP WITH TIME ZONE '2020-01-04 01:45:07+00', 'Como há já tanto tempo que ordenaste,
');

VALUES (355, 625, TIMESTAMP WITH TIME ZONE '2018-09-12 07:08:45+00', 'Co ela o Castelhano, e com destreza
');
VALUES (355, 356, TIMESTAMP WITH TIME ZONE '2018-09-12 13:58:25+00', 'Abrantes, que também da fonte fria
');
VALUES (355, 356, TIMESTAMP WITH TIME ZONE '2018-09-12 15:50:59+00', 'Tudo tem no seu Reino em grande cópia.
');
VALUES (355, 625, TIMESTAMP WITH TIME ZONE '2018-09-12 19:19:55+00', 'Outros fazem vestidos de mil cores,
');

VALUES (356, 439, TIMESTAMP WITH TIME ZONE '2019-05-14 22:53:38+00', 'O grã progenitor dos Reis primeiros.
');
VALUES (356, 439, TIMESTAMP WITH TIME ZONE '2019-05-14 23:59:44+00', 'Abrindo as pandas asas vão ao vento,
');
VALUES (356, 439, TIMESTAMP WITH TIME ZONE '2019-05-15 04:12:15+00', 'Diz-lhe que acompanhando o Lusitano,
');

VALUES (357, 390, TIMESTAMP WITH TIME ZONE '2020-11-25 09:34:43+00', 'Todos por mim fareis o que é devido;
');

VALUES (358, 463, TIMESTAMP WITH TIME ZONE '2020-11-30 22:41:31+00', '"Viram gentes incógnitas e estranhas
');
VALUES (358, 463, TIMESTAMP WITH TIME ZONE '2020-12-01 02:18:51+00', 'Vede, Ninfas, que engenhos de senhores
');

VALUES (359, 641, TIMESTAMP WITH TIME ZONE '2020-04-09 05:34:04+00', 'No reino os inimigos, não se atrevem
');
VALUES (359, 361, TIMESTAMP WITH TIME ZONE '2020-04-09 12:40:01+00', 'De quanto mal a vil malícia ousada
');
VALUES (359, 361, TIMESTAMP WITH TIME ZONE '2020-04-09 14:06:25+00', 'Até que à força só de braço aprendem
');

VALUES (360, 373, TIMESTAMP WITH TIME ZONE '2020-11-29 23:01:14+00', 'Culpa de Reis, que às vezes a privados
');
VALUES (360, 361, TIMESTAMP WITH TIME ZONE '2020-11-30 04:23:53+00', 'E o Rei ilustre, o peito obediente
');
VALUES (360, 373, TIMESTAMP WITH TIME ZONE '2020-11-30 06:58:09+00', 'Do mar, que contra nós ali corria,
');
VALUES (360, 373, TIMESTAMP WITH TIME ZONE '2020-11-30 11:34:44+00', 'Que o nome tem da terra, para exemplo,
');

VALUES (361, 362, TIMESTAMP WITH TIME ZONE '2020-02-23 01:33:42+00', 'Olha deles a bruta multidão,
');

VALUES (362, 362, TIMESTAMP WITH TIME ZONE '2018-07-12 13:01:48+00', 'Por meio destes hórridos perigos,
');
VALUES (362, 362, TIMESTAMP WITH TIME ZONE '2018-07-12 19:35:40+00', 'Picam de esporas, largam rédeas logo,
');
VALUES (362, 543, TIMESTAMP WITH TIME ZONE '2018-07-13 01:00:56+00', 'Que todo o mar de Ninfas povoara;
');
VALUES (362, 362, TIMESTAMP WITH TIME ZONE '2018-07-13 04:21:11+00', 'Do generoso tronco, e casa rica,
');

VALUES (363, 632, TIMESTAMP WITH TIME ZONE '2021-03-20 20:00:47+00', 'Fogo de altos desejos, que a movera!
');
VALUES (363, 363, TIMESTAMP WITH TIME ZONE '2021-03-21 02:00:45+00', 'O Sol, que para o Norte os carros guia,
');

VALUES (364, 363, TIMESTAMP WITH TIME ZONE '2020-01-29 22:09:54+00', 'Foram do Duque Inglês experimentado.
');

VALUES (365, 365, TIMESTAMP WITH TIME ZONE '2020-12-30 11:04:05+00', 'Não usado licor, que dá alegria.
');
VALUES (365, 365, TIMESTAMP WITH TIME ZONE '2020-12-30 12:10:25+00', 'Nos animais cavalgam de Neptuno,
');

VALUES (366, 602, TIMESTAMP WITH TIME ZONE '2019-11-22 23:07:54+00', 'Tão bem de suas obras merecida.
');

VALUES (367, 368, TIMESTAMP WITH TIME ZONE '2020-09-28 22:20:20+00', 'Te contei tudo quanto me pediste.
');

VALUES (368, 446, TIMESTAMP WITH TIME ZONE '2019-10-17 17:53:26+00', 'Já não fugia a bela Ninfa, tanto
');
VALUES (368, 368, TIMESTAMP WITH TIME ZONE '2019-10-17 22:03:38+00', 'Que não se enxerga: é o Móbile primeiro.
');
VALUES (368, 446, TIMESTAMP WITH TIME ZONE '2019-10-18 03:28:22+00', 'Que nenhum no bem público imagina;
');
VALUES (368, 368, TIMESTAMP WITH TIME ZONE '2019-10-18 06:32:45+00', 'Vai César, sojugando toda França,
');

VALUES (369, 369, TIMESTAMP WITH TIME ZONE '2021-02-03 21:03:26+00', 'No rosto traz, descia diligente.
');
VALUES (369, 369, TIMESTAMP WITH TIME ZONE '2021-02-03 22:19:44+00', 'Carmânia teve já por apelido.
');
VALUES (369, 378, TIMESTAMP WITH TIME ZONE '2021-02-04 06:15:44+00', 'Mas o bem logo muda a natureza.
');

VALUES (370, 442, TIMESTAMP WITH TIME ZONE '2020-11-17 10:02:28+00', 'Os que de espada vêm fazer batalha,
');
VALUES (370, 373, TIMESTAMP WITH TIME ZONE '2020-11-17 15:54:25+00', 'Fantásticas, fingidas, mentirosas,
');
VALUES (370, 373, TIMESTAMP WITH TIME ZONE '2020-11-17 21:36:04+00', 'Ligeiros e feroces, de alta raça;
');
VALUES (370, 373, TIMESTAMP WITH TIME ZONE '2020-11-18 03:02:13+00', 'Encrespa a água serena e despertava
');

VALUES (371, 615, TIMESTAMP WITH TIME ZONE '2020-04-27 14:20:04+00', 'Perde a virtude contra tanta gente.
');
VALUES (371, 374, TIMESTAMP WITH TIME ZONE '2020-04-27 20:00:33+00', 'Eis, de meus companheiros rodeado,
');
VALUES (371, 615, TIMESTAMP WITH TIME ZONE '2020-04-27 20:22:25+00', 'Cristãos, como o piloto lhe dizia;
');
VALUES (371, 615, TIMESTAMP WITH TIME ZONE '2020-04-28 03:24:38+00', 'Que viu de Deus a carne em si lavada;
');

VALUES (372, 499, TIMESTAMP WITH TIME ZONE '2020-09-02 21:23:52+00', 'Pois contra o Castelhano tão temido,
');
VALUES (372, 499, TIMESTAMP WITH TIME ZONE '2020-09-03 03:58:11+00', 'Que pela especiaria troque e venda.
');

VALUES (373, 677, TIMESTAMP WITH TIME ZONE '2020-10-18 20:06:42+00', 'Por cavaleiro, sábio e virtuoso.
');
VALUES (373, 677, TIMESTAMP WITH TIME ZONE '2020-10-18 23:58:11+00', 'Daqui me parto irado, e quase insano
');
VALUES (373, 677, TIMESTAMP WITH TIME ZONE '2020-10-19 05:59:48+00', 'Ou se queres luzente pedraria,
');

VALUES (374, 427, TIMESTAMP WITH TIME ZONE '2019-12-21 18:39:24+00', 'Ligeiros e feroces, de alta raça;
');
VALUES (374, 427, TIMESTAMP WITH TIME ZONE '2019-12-22 02:36:49+00', 'Com as lindas conchinhas, que o salgado
');
VALUES (374, 376, TIMESTAMP WITH TIME ZONE '2019-12-22 03:25:15+00', 'Para que de seus reinos se servissem.
');
VALUES (374, 427, TIMESTAMP WITH TIME ZONE '2019-12-22 05:38:46+00', 'Que o Céu revolve e rege a gente humana,
');

VALUES (375, 607, TIMESTAMP WITH TIME ZONE '2021-02-12 05:43:00+00', 'Mostrando-lhe as amadas Ninfas belas,
');

VALUES (376, 689, TIMESTAMP WITH TIME ZONE '2019-02-04 15:56:24+00', 'Vingança de Trancoso destruída
');
VALUES (376, 377, TIMESTAMP WITH TIME ZONE '2019-02-04 18:42:09+00', 'No tronco, e fàcilmente o leva e arrasta
');
VALUES (376, 689, TIMESTAMP WITH TIME ZONE '2019-02-05 00:08:27+00', 'Perdeu, vendo Diana na água clara,
');
VALUES (376, 689, TIMESTAMP WITH TIME ZONE '2019-02-05 02:33:19+00', 'Que tamanhas misérias me cercassem,
');

VALUES (377, 378, TIMESTAMP WITH TIME ZONE '2021-01-18 04:31:27+00', 'No gesto ledos vêm, e humanamente
');
VALUES (377, 378, TIMESTAMP WITH TIME ZONE '2021-01-18 09:00:36+00', '"Beatriz era a filha, que casada
');

VALUES (378, 378, TIMESTAMP WITH TIME ZONE '2021-02-15 10:47:05+00', 'Árduo, difícil, duro a humano trato.
');
VALUES (378, 443, TIMESTAMP WITH TIME ZONE '2021-02-15 14:05:19+00', 'De contar cousa fabulosa ou nova;
');
VALUES (378, 443, TIMESTAMP WITH TIME ZONE '2021-02-15 17:00:33+00', 'Do povo, e faz que tome o doce freio
');
VALUES (378, 378, TIMESTAMP WITH TIME ZONE '2021-02-15 19:25:53+00', 'Nunca à terra e só mortas aparecem.
');

VALUES (379, 674, TIMESTAMP WITH TIME ZONE '2019-07-25 21:17:05+00', 'Ao vento leve, e à seta bem talhada,
');

VALUES (380, 474, TIMESTAMP WITH TIME ZONE '2021-01-14 16:50:31+00', 'Milagre, e coisa certo de alto espanto,
');
VALUES (380, 474, TIMESTAMP WITH TIME ZONE '2021-01-14 18:27:07+00', 'Amostrarão esforço mais que humano,
');

VALUES (381, 390, TIMESTAMP WITH TIME ZONE '2020-11-10 03:20:58+00', 'Que da paternal coxa foi nascido,
');
VALUES (381, 381, TIMESTAMP WITH TIME ZONE '2020-11-10 10:36:38+00', 'Do cheiroso licor que o tronco chora,
');
VALUES (381, 381, TIMESTAMP WITH TIME ZONE '2020-11-10 11:41:40+00', 'Que nunca para o céu fossem viradas,
');

VALUES (382, 381, TIMESTAMP WITH TIME ZONE '2019-11-07 00:53:19+00', 'Ouvido tinha aos Fados que viria
');
VALUES (382, 517, TIMESTAMP WITH TIME ZONE '2019-11-07 01:15:13+00', 'Ou, para que se emende, às vezes tarda,
');
VALUES (382, 517, TIMESTAMP WITH TIME ZONE '2019-11-07 06:54:55+00', 'Que bem mostra estimar o santo dia.
');
VALUES (382, 381, TIMESTAMP WITH TIME ZONE '2019-11-07 13:51:59+00', 'Mais do que prometia a força humana,
');

VALUES (383, 572, TIMESTAMP WITH TIME ZONE '2020-10-13 13:09:17+00', 'A cândida pombinha debuxada
');
VALUES (383, 572, TIMESTAMP WITH TIME ZONE '2020-10-13 18:17:05+00', 'Um terreno muito grande e assaz famoso,
');
VALUES (383, 572, TIMESTAMP WITH TIME ZONE '2020-10-13 21:09:56+00', 'Neste terreno meu, que duro e irado
');

VALUES (384, 651, TIMESTAMP WITH TIME ZONE '2020-04-23 07:33:42+00', 'A quem para perdê-la não fez erro.
');
VALUES (384, 651, TIMESTAMP WITH TIME ZONE '2020-04-23 08:43:06+00', 'No mar Índico, e cercam todo o peso
');
VALUES (384, 651, TIMESTAMP WITH TIME ZONE '2020-04-23 14:40:51+00', 'Os cavalos que o carro marchetado
');

VALUES (385, 384, TIMESTAMP WITH TIME ZONE '2021-04-15 20:44:44+00', 'Não sente quem a leva o doce peso,
');

VALUES (386, 384, TIMESTAMP WITH TIME ZONE '2020-01-31 19:18:42+00', 'De vencedores ásperos e ousados,
');
VALUES (386, 406, TIMESTAMP WITH TIME ZONE '2020-01-31 21:05:26+00', 'Até que houveram vista do terreno
');
VALUES (386, 406, TIMESTAMP WITH TIME ZONE '2020-02-01 02:03:00+00', 'Que exemplos a futuros escritores,
');
VALUES (386, 384, TIMESTAMP WITH TIME ZONE '2020-02-01 03:44:56+00', 'Que com tão forte peito navegais.
');

VALUES (387, 385, TIMESTAMP WITH TIME ZONE '2021-04-09 00:35:00+00', 'Logo, corno tornou do Reino o cargo,
');
VALUES (387, 544, TIMESTAMP WITH TIME ZONE '2021-04-09 02:05:51+00', '"Este orbe que, primeiro, vai cercando
');
VALUES (387, 385, TIMESTAMP WITH TIME ZONE '2021-04-09 05:34:26+00', 'Rosto, como quem sabe a língua Hispana,
');

VALUES (388, 625, TIMESTAMP WITH TIME ZONE '2020-08-02 14:32:46+00', 'Mas enxerga-se bem que está composto
');
VALUES (388, 387, TIMESTAMP WITH TIME ZONE '2020-08-02 22:03:51+00', 'Com que Ceilão é rica, ilustre e bela.
');
VALUES (388, 625, TIMESTAMP WITH TIME ZONE '2020-08-02 23:14:27+00', 'Contra seu Capitão, se os resistira,
');
VALUES (388, 625, TIMESTAMP WITH TIME ZONE '2020-08-03 04:41:22+00', '"E para isso queria que, feridas
');

VALUES (389, 507, TIMESTAMP WITH TIME ZONE '2021-04-08 16:48:01+00', 'De que Nisa celebra inda a memória.
');
VALUES (389, 388, TIMESTAMP WITH TIME ZONE '2021-04-08 18:58:18+00', 'Deixamos para sempre os companheiros,
');
VALUES (389, 388, TIMESTAMP WITH TIME ZONE '2021-04-08 22:13:32+00', 'Ganges vem ao salgado senhorio;
');

VALUES (390, 398, TIMESTAMP WITH TIME ZONE '2020-07-29 16:35:57+00', 'Com tantas qualidades generosas,
');
VALUES (390, 398, TIMESTAMP WITH TIME ZONE '2020-07-30 00:09:43+00', 'Mombaça é o nome da ilha e da cidade.
');
VALUES (390, 388, TIMESTAMP WITH TIME ZONE '2020-07-30 03:08:50+00', 'Esculpido o feroz ginete ardente,
');
VALUES (390, 388, TIMESTAMP WITH TIME ZONE '2020-07-30 03:32:38+00', 'Desejoso de ver as coisas grandes,
');

VALUES (391, 389, TIMESTAMP WITH TIME ZONE '2020-04-08 22:37:59+00', 'Já foram contra a gente Mahometa;
');
VALUES (391, 582, TIMESTAMP WITH TIME ZONE '2020-04-09 04:22:18+00', '"Juntos os dous Afonsos finalmente
');
VALUES (391, 389, TIMESTAMP WITH TIME ZONE '2020-04-09 06:47:09+00', 'Para a frota, que o Mouro bem conhece;
');

VALUES (392, 389, TIMESTAMP WITH TIME ZONE '2020-11-13 04:33:06+00', 'E compassar a universal pintura.
');
VALUES (392, 389, TIMESTAMP WITH TIME ZONE '2020-11-13 11:33:58+00', 'Sem grandes opressões, e em todo o feito
');

VALUES (393, 533, TIMESTAMP WITH TIME ZONE '2020-11-21 02:27:18+00', 'Júpiter, Juno, fomos fabulosos,
');
VALUES (393, 533, TIMESTAMP WITH TIME ZONE '2020-11-21 03:10:58+00', '"Vês este que, saindo da cilada,
');

VALUES (394, 602, TIMESTAMP WITH TIME ZONE '2020-11-15 00:37:11+00', 'Aqui há as áureas aves, que não decem
');

VALUES (395, 391, TIMESTAMP WITH TIME ZONE '2019-03-20 10:07:45+00', '"Com toda esta lustrosa companhia
');
VALUES (395, 623, TIMESTAMP WITH TIME ZONE '2019-03-20 13:12:26+00', 'No carro ajunta as aves que na vida
');
VALUES (395, 391, TIMESTAMP WITH TIME ZONE '2019-03-20 19:42:59+00', 'Mas, deixando conselhos temerários,
');

VALUES (396, 391, TIMESTAMP WITH TIME ZONE '2019-09-19 23:36:32+00', 'Foram com gestos ledos e fingidos,
');
VALUES (396, 547, TIMESTAMP WITH TIME ZONE '2019-09-20 04:49:29+00', 'Espanha, França, Itália celebrada,
');
VALUES (396, 391, TIMESTAMP WITH TIME ZONE '2019-09-20 12:28:55+00', 'O mancebo Lourenço fará extremos.
');

VALUES (397, 637, TIMESTAMP WITH TIME ZONE '2020-04-20 19:42:24+00', 'Que de tal pai tal filho se esperava.
');

VALUES (398, 465, TIMESTAMP WITH TIME ZONE '2020-06-10 17:47:52+00', 'Seu tão célebre nome em negro vaso
');
VALUES (398, 392, TIMESTAMP WITH TIME ZONE '2020-06-10 21:57:15+00', 'Não era de espantar se se espantasse,
');

VALUES (399, 506, TIMESTAMP WITH TIME ZONE '2020-12-22 02:33:20+00', 'defenderá Nhaia com destreza.
');

VALUES (400, 394, TIMESTAMP WITH TIME ZONE '2021-01-02 03:08:08+00', 'Cornélio moço os faz que, compelidos
');

VALUES (401, 395, TIMESTAMP WITH TIME ZONE '2020-12-23 17:26:31+00', 'Das naus as velas côncavas inchando;
');

VALUES (402, 463, TIMESTAMP WITH TIME ZONE '2021-01-29 12:07:21+00', 'Cometerão convosco, e não duvido
');
VALUES (402, 396, TIMESTAMP WITH TIME ZONE '2021-01-29 16:22:28+00', 'Ou quem viu em fortuna haver firmeza?
');
VALUES (402, 463, TIMESTAMP WITH TIME ZONE '2021-01-29 17:38:54+00', 'Os Cicones, e a torra onde se esqueçam
');
VALUES (402, 396, TIMESTAMP WITH TIME ZONE '2021-01-29 20:19:29+00', 'Neste socorro tanto confiavam,
');

VALUES (403, 397, TIMESTAMP WITH TIME ZONE '2020-04-08 22:43:04+00', 'Ou se são dos de Cristo, como Crê.
');
VALUES (403, 582, TIMESTAMP WITH TIME ZONE '2020-04-08 22:44:09+00', 'Responde-lhe do ramo filomela;
');

VALUES (404, 399, TIMESTAMP WITH TIME ZONE '2018-10-08 06:01:34+00', 'De Luso não perdeis o pensamento,
');
VALUES (404, 439, TIMESTAMP WITH TIME ZONE '2018-10-08 08:29:02+00', 'Que moveram de um tigre o peito duro,
');
VALUES (404, 399, TIMESTAMP WITH TIME ZONE '2018-10-08 12:16:39+00', 'Que os peitos generosos enobrece,
');

VALUES (405, 401, TIMESTAMP WITH TIME ZONE '2020-02-01 04:34:04+00', 'De já nos não tornar a ver tão cedo.
');

VALUES (406, 620, TIMESTAMP WITH TIME ZONE '2020-10-05 15:37:45+00', 'Chama-se a pequena ilha Moçambique.
');
VALUES (406, 620, TIMESTAMP WITH TIME ZONE '2020-10-05 19:03:33+00', 'Quando em Évora a voz de uma menina,
');
VALUES (406, 402, TIMESTAMP WITH TIME ZONE '2020-10-06 00:01:43+00', 'Das Tágides gentis, e seu respeito.
');
VALUES (406, 402, TIMESTAMP WITH TIME ZONE '2020-10-06 06:42:27+00', 'De quem os olha, se alvoroça e teme:
');

VALUES (407, 405, TIMESTAMP WITH TIME ZONE '2019-07-20 21:04:20+00', 'Sofrerá suas cidades e lugares,
');
VALUES (407, 405, TIMESTAMP WITH TIME ZONE '2019-07-21 00:35:36+00', 'Se chega um Mahometa, que nascido
');
VALUES (407, 405, TIMESTAMP WITH TIME ZONE '2019-07-21 07:45:24+00', '"Tem o Tarragonês, que se fez claro
');
VALUES (407, 405, TIMESTAMP WITH TIME ZONE '2019-07-21 08:56:43+00', 'Vai César, sojugando toda França,
');

VALUES (408, 406, TIMESTAMP WITH TIME ZONE '2020-02-23 15:34:52+00', 'Fantásticas, fingidas, mentirosas,
');
VALUES (408, 690, TIMESTAMP WITH TIME ZONE '2020-02-23 22:11:28+00', 'De cavaleiro destro ou esforçado;
');

VALUES (409, 408, TIMESTAMP WITH TIME ZONE '2021-01-31 08:10:23+00', 'Onde segunda vez terra tomamos.
');
VALUES (409, 408, TIMESTAMP WITH TIME ZONE '2021-01-31 13:24:41+00', 'Mais do que fez a gente alta de Roma;
');
VALUES (409, 408, TIMESTAMP WITH TIME ZONE '2021-01-31 16:59:43+00', 'Vendo estas namoradas estranhezas
');
VALUES (409, 408, TIMESTAMP WITH TIME ZONE '2021-01-31 19:40:03+00', 'Bem no filho de Alcmena se parece,
');

VALUES (410, 410, TIMESTAMP WITH TIME ZONE '2021-05-10 12:31:45+00', '"Mas já o Planeta que no céu primeiro
');
VALUES (410, 410, TIMESTAMP WITH TIME ZONE '2021-05-10 14:37:39+00', 'Se a corrompida fama lhe concede.
');

VALUES (411, 411, TIMESTAMP WITH TIME ZONE '2019-11-28 11:58:11+00', 'Já no batel entrou do Capitão
');
VALUES (411, 452, TIMESTAMP WITH TIME ZONE '2019-11-28 13:17:21+00', 'No campo e na cidade juntamente.
');
VALUES (411, 411, TIMESTAMP WITH TIME ZONE '2019-11-28 15:03:20+00', 'Antes do tempo foi, cândida e bela,
');
VALUES (411, 452, TIMESTAMP WITH TIME ZONE '2019-11-28 21:57:56+00', 'A capitania sobem forte e bela,
');

VALUES (412, 537, TIMESTAMP WITH TIME ZONE '2019-11-23 15:42:26+00', 'Das vitórias do Bárbaro, que acode
');
VALUES (412, 411, TIMESTAMP WITH TIME ZONE '2019-11-23 18:17:20+00', 'Andais de vosso sangue, ó gente insana!
');
VALUES (412, 537, TIMESTAMP WITH TIME ZONE '2019-11-24 02:17:02+00', 'Terá vitórias, terras e cidades,
');

VALUES (413, 412, TIMESTAMP WITH TIME ZONE '2020-05-19 12:59:10+00', 'Agora o mar, depois o fresco rio.
');
VALUES (413, 412, TIMESTAMP WITH TIME ZONE '2020-05-19 15:27:37+00', 'A golpes de Idolátras e de Mouros,
');
VALUES (413, 412, TIMESTAMP WITH TIME ZONE '2020-05-19 20:30:34+00', '"Eis vem despois o pai, que as ondas corta
');

VALUES (414, 553, TIMESTAMP WITH TIME ZONE '2021-02-22 09:30:30+00', '"Logo os Dálmatas vivem; e no seio,
');
VALUES (414, 416, TIMESTAMP WITH TIME ZONE '2021-02-22 10:54:14+00', 'E ainda, Ninfas minhas, não bastava
');

VALUES (415, 690, TIMESTAMP WITH TIME ZONE '2020-03-02 09:46:01+00', 'Vence os imigos d''alma todos sete;
');
VALUES (415, 416, TIMESTAMP WITH TIME ZONE '2020-03-02 16:02:40+00', 'Estas que ora de novo são chegadas;
');
VALUES (415, 690, TIMESTAMP WITH TIME ZONE '2020-03-02 21:28:03+00', 'Foram com gestos ledos e fingidos,
');

VALUES (416, 417, TIMESTAMP WITH TIME ZONE '2021-03-20 00:54:00+00', 'Com uma alta confiança, que convinha,
');
VALUES (416, 417, TIMESTAMP WITH TIME ZONE '2021-03-20 06:32:25+00', 'Vendo Vasco da Gama que tão perto
');

VALUES (417, 660, TIMESTAMP WITH TIME ZONE '2020-10-05 13:25:53+00', 'São pelos Malabares admitidos.
');

VALUES (418, 419, TIMESTAMP WITH TIME ZONE '2020-12-25 03:15:33+00', 'Se alguma traz idónea lá da banda
');

VALUES (419, 667, TIMESTAMP WITH TIME ZONE '2020-12-22 04:42:12+00', 'As palavras lhe diz do santo velho,
');

VALUES (420, 661, TIMESTAMP WITH TIME ZONE '2019-03-11 09:14:54+00', 'Ficava a Maura gente magoada,
');
VALUES (420, 420, TIMESTAMP WITH TIME ZONE '2019-03-11 15:14:27+00', 'A cor, o gesto estranho, o trajo novo
');

VALUES (421, 423, TIMESTAMP WITH TIME ZONE '2021-02-26 01:41:09+00', '"Esta ilha pequena, que habitamos,
');

VALUES (422, 424, TIMESTAMP WITH TIME ZONE '2020-10-31 06:47:11+00', 'Que com tanto temor buscando vinha,
');

VALUES (423, 527, TIMESTAMP WITH TIME ZONE '2020-12-25 15:44:31+00', 'Não sofre amores, nem delicadeza;
');
VALUES (423, 424, TIMESTAMP WITH TIME ZONE '2020-12-25 19:52:26+00', 'Consigo a Fama leva, por que diga
');
VALUES (423, 527, TIMESTAMP WITH TIME ZONE '2020-12-26 03:25:13+00', 'Para os determinados aposentos.
');
VALUES (423, 424, TIMESTAMP WITH TIME ZONE '2020-12-26 11:18:35+00', 'No Céu sereno, abrindo a roxa entrada
');

VALUES (424, 635, TIMESTAMP WITH TIME ZONE '2020-04-15 17:13:10+00', '"Mas tu, de quem ficou tão mal pagado
');
VALUES (424, 635, TIMESTAMP WITH TIME ZONE '2020-04-16 01:07:11+00', 'Dele em Germânia, com que a morte engane;
');
VALUES (424, 635, TIMESTAMP WITH TIME ZONE '2020-04-16 04:37:03+00', 'Como quem da pergunta lhe pesara:
');
VALUES (424, 426, TIMESTAMP WITH TIME ZONE '2020-04-16 06:58:12+00', 'Quando do ferro as vidas escapavam.
');

VALUES (425, 426, TIMESTAMP WITH TIME ZONE '2019-11-23 04:51:20+00', '"Traziam-na os horríficos algozes
');
VALUES (425, 426, TIMESTAMP WITH TIME ZONE '2019-11-23 06:26:09+00', 'Por climas e por mares não sabidos,
');

VALUES (426, 427, TIMESTAMP WITH TIME ZONE '2019-12-02 07:39:17+00', 'Quem, como Astianás, precipitado,
');
VALUES (426, 591, TIMESTAMP WITH TIME ZONE '2019-12-02 08:44:03+00', 'O principal, que ao peito traz os fios,
');

VALUES (427, 427, TIMESTAMP WITH TIME ZONE '2019-12-18 15:54:30+00', '"Já descoberto tínhamos diante,
');

VALUES (428, 647, TIMESTAMP WITH TIME ZONE '2020-05-07 04:45:18+00', '"Este, que socorrer-lhe não queria,
');
VALUES (428, 647, TIMESTAMP WITH TIME ZONE '2020-05-07 10:49:54+00', 'Mostrando-se senhora grande e egrégia.
');
VALUES (428, 647, TIMESTAMP WITH TIME ZONE '2020-05-07 17:02:51+00', 'A seus batéis velozes que traziam;
');
VALUES (428, 647, TIMESTAMP WITH TIME ZONE '2020-05-07 22:38:36+00', 'Para que à gente mande que se aparte
');

VALUES (429, 428, TIMESTAMP WITH TIME ZONE '2021-01-31 23:07:49+00', 'Com que co alma o corpo se liara:
');
VALUES (429, 428, TIMESTAMP WITH TIME ZONE '2021-02-01 05:57:52+00', 'Quebrado leva o masto pelo meio.
');
VALUES (429, 581, TIMESTAMP WITH TIME ZONE '2021-02-01 11:32:29+00', 'Nomes com quem se o povo néscio engana!
');
VALUES (429, 581, TIMESTAMP WITH TIME ZONE '2021-02-01 18:42:08+00', 'Trazidos lá do Atlântico tesouro.
');

VALUES (430, 430, TIMESTAMP WITH TIME ZONE '2021-03-22 15:19:17+00', 'Quando dos teus fermosos se apartavam:
');
VALUES (430, 694, TIMESTAMP WITH TIME ZONE '2021-03-22 23:00:03+00', 'Mas via-se livrado tão asinha
');
VALUES (430, 430, TIMESTAMP WITH TIME ZONE '2021-03-23 02:24:23+00', 'Caem as Ninfas, lançam das secretas
');

VALUES (431, 430, TIMESTAMP WITH TIME ZONE '2020-07-25 09:19:22+00', 'Fará ir ver o frio e fundo assento,
');

VALUES (432, 431, TIMESTAMP WITH TIME ZONE '2019-01-20 10:06:55+00', 'Uns vão nas almadias carregadas,
');
VALUES (432, 600, TIMESTAMP WITH TIME ZONE '2019-01-20 16:13:00+00', 'Povo antigo cristão sempre habitou.
');

VALUES (433, 433, TIMESTAMP WITH TIME ZONE '2020-11-10 12:01:10+00', 'Do Sol foram no mundo, e num momento
');
VALUES (433, 464, TIMESTAMP WITH TIME ZONE '2020-11-10 17:38:20+00', '"Vê-lo cá vai com os filhos a entregar-se,
');
VALUES (433, 433, TIMESTAMP WITH TIME ZONE '2020-11-10 21:21:58+00', 'Porque uns poucos a terra lhe detêm.
');
VALUES (433, 433, TIMESTAMP WITH TIME ZONE '2020-11-10 21:26:01+00', 'Da âncora, o mar ferido, em cima salta.
');

VALUES (434, 433, TIMESTAMP WITH TIME ZONE '2021-03-06 05:27:04+00', 'Estava um grande exército que pisa
');
VALUES (434, 694, TIMESTAMP WITH TIME ZONE '2021-03-06 10:10:04+00', 'Depois que tudo deu, se lhe apresenta:
');
VALUES (434, 694, TIMESTAMP WITH TIME ZONE '2021-03-06 15:42:01+00', 'Sem que to merecesse, nem te errasse,
');
VALUES (434, 694, TIMESTAMP WITH TIME ZONE '2021-03-06 17:20:26+00', '"Nunca com Marte instructo e furioso,
');

VALUES (435, 435, TIMESTAMP WITH TIME ZONE '2021-03-04 03:57:57+00', 'E por que tudo enfim vos notifique,
');
VALUES (435, 474, TIMESTAMP WITH TIME ZONE '2021-03-04 04:57:15+00', 'Que, em ver embaixadores de nação
');

VALUES (436, 435, TIMESTAMP WITH TIME ZONE '2019-11-24 15:11:10+00', '"Já se ajuntam do monte a quem Medusa
');
VALUES (436, 461, TIMESTAMP WITH TIME ZONE '2019-11-24 19:29:35+00', '"Este que vês olhar com gesto irado
');

VALUES (437, 537, TIMESTAMP WITH TIME ZONE '2019-12-21 03:05:46+00', 'Porque esta era a cidade das melhores
');
VALUES (437, 436, TIMESTAMP WITH TIME ZONE '2019-12-21 05:05:11+00', 'Tudo o Gentio nota; mas o intento
');
VALUES (437, 436, TIMESTAMP WITH TIME ZONE '2019-12-21 12:10:40+00', 'Sagaz consumidora conhecida
');

VALUES (438, 440, TIMESTAMP WITH TIME ZONE '2021-01-29 05:32:13+00', 'As lágrimas que em vão caídas vejo,
');
VALUES (438, 440, TIMESTAMP WITH TIME ZONE '2021-01-29 10:54:51+00', 'Cai a soberba Inglesa de seu trono,
');
VALUES (438, 440, TIMESTAMP WITH TIME ZONE '2021-01-29 16:35:54+00', 'Aqui toda a Africana costa acabo
');
VALUES (438, 440, TIMESTAMP WITH TIME ZONE '2021-01-29 22:45:59+00', 'Ó descoberto engano inopinado,
');

VALUES (439, 673, TIMESTAMP WITH TIME ZONE '2020-09-28 19:26:50+00', 'Por que razão lhe impede e lhe difere
');

VALUES (440, 568, TIMESTAMP WITH TIME ZONE '2019-05-03 14:55:41+00', 'A navegação certa, e assim caminha
');

VALUES (441, 442, TIMESTAMP WITH TIME ZONE '2021-02-13 05:40:49+00', 'Da parte de Netuno, que sem conto
');

VALUES (442, 442, TIMESTAMP WITH TIME ZONE '2018-12-03 02:19:16+00', 'Degradado, conosco se alevanta:
');
VALUES (442, 634, TIMESTAMP WITH TIME ZONE '2018-12-03 04:00:52+00', 'Tudo faz a vital necessidade."
');
VALUES (442, 442, TIMESTAMP WITH TIME ZONE '2018-12-03 09:23:43+00', 'Que nesses fios de ouro reluzente
');

VALUES (443, 555, TIMESTAMP WITH TIME ZONE '2019-12-17 12:57:55+00', 'Que agora tem do mundo o senhorio,
');
VALUES (443, 555, TIMESTAMP WITH TIME ZONE '2019-12-17 14:39:18+00', 'Que, posto que é de amor usança boa,
');
VALUES (443, 555, TIMESTAMP WITH TIME ZONE '2019-12-17 18:34:59+00', 'Giraldo Sem-pavor é o forte peito.
');

VALUES (444, 443, TIMESTAMP WITH TIME ZONE '2021-01-14 18:29:41+00', 'Que às terras se passasse d''Alentejo,
');
VALUES (444, 443, TIMESTAMP WITH TIME ZONE '2021-01-14 20:48:05+00', 'Nace, que não souberam os antigos;
');
