VALUES (517, 516, TIMESTAMP WITH TIME ZONE '2020-08-20 05:51:29+00', 'E com razões me louva esta vontade;
');

VALUES (518, 519, TIMESTAMP WITH TIME ZONE '2020-08-02 15:40:43+00', 'Mas vês o fermoso Indo, que daquela
');
VALUES (518, 649, TIMESTAMP WITH TIME ZONE '2020-08-02 21:33:33+00', 'Que tanto bem não é para esconder-se.
');
VALUES (518, 519, TIMESTAMP WITH TIME ZONE '2020-08-02 22:23:10+00', '"Queria perdoar-lhe o Rei benino,
');

VALUES (519, 647, TIMESTAMP WITH TIME ZONE '2021-01-19 12:29:45+00', 'Que as Ninfas do Oceano tão formosas,
');

VALUES (520, 584, TIMESTAMP WITH TIME ZONE '2021-02-06 10:55:42+00', 'Que triunfos, que palmas, que vitórias?
');
VALUES (520, 521, TIMESTAMP WITH TIME ZONE '2021-02-06 14:42:54+00', 'Vínculo quer contigo de amizade.
');
VALUES (520, 521, TIMESTAMP WITH TIME ZONE '2021-02-06 20:14:58+00', 'De Formião, filósofo elegante,
');
VALUES (520, 584, TIMESTAMP WITH TIME ZONE '2021-02-07 03:10:21+00', 'Tão próprio, que se ali estiver Semele,
');

VALUES (521, 576, TIMESTAMP WITH TIME ZONE '2020-08-05 17:36:16+00', 'O grã legislador que a teus passados
');

VALUES (522, 534, TIMESTAMP WITH TIME ZONE '2020-04-19 15:42:04+00', 'Ninguém a grandes obras sempre o peito,
');
VALUES (522, 534, TIMESTAMP WITH TIME ZONE '2020-04-19 15:46:03+00', 'As ondas de Anfitrite dividia,
');
VALUES (522, 522, TIMESTAMP WITH TIME ZONE '2020-04-19 15:48:17+00', 'Tão bem de suas obras merecida.
');

VALUES (523, 523, TIMESTAMP WITH TIME ZONE '2020-11-07 01:34:28+00', 'E como contra o Céu não valem mãos,
');
VALUES (523, 523, TIMESTAMP WITH TIME ZONE '2020-11-07 04:08:10+00', 'Temístoeles despertam só de inveja,
');

VALUES (524, 524, TIMESTAMP WITH TIME ZONE '2018-06-02 10:48:10+00', 'Eram os seus mais certos refrigérios.
');
VALUES (524, 524, TIMESTAMP WITH TIME ZONE '2018-06-02 17:59:03+00', 'Bem se enxerga nos pomos e boninas
');

VALUES (525, 524, TIMESTAMP WITH TIME ZONE '2019-12-28 01:42:22+00', 'Nem, Camenas, também cuideis que canto
');

VALUES (526, 527, TIMESTAMP WITH TIME ZONE '2021-01-14 19:43:00+00', '--"Ó Ninfa, a mais formosa do Oceano,
');
VALUES (526, 675, TIMESTAMP WITH TIME ZONE '2021-01-14 23:50:22+00', 'Põe-se a Deusa com outras em direito
');

VALUES (527, 692, TIMESTAMP WITH TIME ZONE '2021-03-20 21:03:06+00', 'Feitas do feroz Mário e do cruento
');

VALUES (528, 639, TIMESTAMP WITH TIME ZONE '2020-07-29 14:24:44+00', 'Quando a cidade entrada se rendera
');
VALUES (528, 529, TIMESTAMP WITH TIME ZONE '2020-07-29 19:10:45+00', 'Que junto a Deusa traz Credulidade.
');
VALUES (528, 639, TIMESTAMP WITH TIME ZONE '2020-07-29 23:52:44+00', '"Viu ser cativo o santo irmão Fernando,
');

VALUES (529, 548, TIMESTAMP WITH TIME ZONE '2019-08-03 09:47:17+00', 'Pelo mar alto, a qual sujeitaria
');

VALUES (530, 671, TIMESTAMP WITH TIME ZONE '2020-10-27 05:13:55+00', 'Tais andavam as Ninfas estorvando
');

VALUES (531, 532, TIMESTAMP WITH TIME ZONE '2021-01-07 16:51:35+00', 'Imos buscando as terras do Oriente.
');
VALUES (531, 590, TIMESTAMP WITH TIME ZONE '2021-01-08 00:18:09+00', 'Somente sei que é gente lá de Espanha,
');
VALUES (531, 590, TIMESTAMP WITH TIME ZONE '2021-01-08 06:52:51+00', 'A Naira geração, que o mar coalhava.
');

VALUES (532, 532, TIMESTAMP WITH TIME ZONE '2020-10-03 22:29:58+00', 'Volvendo o rosto já sereno e santo,
');

VALUES (533, 533, TIMESTAMP WITH TIME ZONE '2020-11-14 21:51:45+00', 'Se veste, por não ter quem nomeado
');
VALUES (533, 533, TIMESTAMP WITH TIME ZONE '2020-11-15 01:43:49+00', 'Que destino tão grande ou que ventura
');
VALUES (533, 533, TIMESTAMP WITH TIME ZONE '2020-11-15 06:51:38+00', 'Duas vezes tomado e sojugado.
');

VALUES (534, 533, TIMESTAMP WITH TIME ZONE '2019-07-10 18:23:04+00', 'A quem ordens, nem aras, nem respeito;
');
VALUES (534, 533, TIMESTAMP WITH TIME ZONE '2019-07-11 02:00:02+00', 'Não sem sangue, porém, que nele geme
');
VALUES (534, 542, TIMESTAMP WITH TIME ZONE '2019-07-11 09:12:43+00', 'Trabalha por mostrar Vasco da Gama
');
VALUES (534, 542, TIMESTAMP WITH TIME ZONE '2019-07-11 11:37:27+00', 'Elas começam súbito a gritar,
');

VALUES (535, 614, TIMESTAMP WITH TIME ZONE '2021-04-14 05:40:29+00', 'Pois os vedados términos quebrantas,
');
VALUES (535, 535, TIMESTAMP WITH TIME ZONE '2021-04-14 06:22:54+00', 'Dar os Reis inimigos por maridos
');
VALUES (535, 614, TIMESTAMP WITH TIME ZONE '2021-04-14 09:43:16+00', 'João, filho de Pedro, moderava,
');
VALUES (535, 614, TIMESTAMP WITH TIME ZONE '2021-04-14 15:01:25+00', 'Em que três Reis das partes do Oriento
');

VALUES (536, 537, TIMESTAMP WITH TIME ZONE '2019-12-09 22:12:36+00', 'Súbito na divina companhia,
');
VALUES (536, 584, TIMESTAMP WITH TIME ZONE '2019-12-10 04:08:51+00', 'Já nisto punha a noite o usado atalho
');
VALUES (536, 584, TIMESTAMP WITH TIME ZONE '2019-12-10 04:38:40+00', 'Vendo como diante ameaçando
');

VALUES (537, 538, TIMESTAMP WITH TIME ZONE '2019-06-02 00:17:17+00', 'O coração dos Deuses foi num ponto,
');

VALUES (538, 539, TIMESTAMP WITH TIME ZONE '2020-01-29 08:14:51+00', 'Os olhos põe no bélico transunto
');
VALUES (538, 605, TIMESTAMP WITH TIME ZONE '2020-01-29 09:51:37+00', 'E assim ledos a noite festejavam.
');
VALUES (538, 605, TIMESTAMP WITH TIME ZONE '2020-01-29 13:50:22+00', 'Que agora esta vitória certifica,
');
VALUES (538, 605, TIMESTAMP WITH TIME ZONE '2020-01-29 21:06:41+00', 'Em nome de Jesu crucificado:
');

VALUES (539, 615, TIMESTAMP WITH TIME ZONE '2020-07-18 05:33:52+00', 'Os dois amantes míseros ficarem
');
VALUES (539, 541, TIMESTAMP WITH TIME ZONE '2020-07-18 07:50:26+00', 'E por que cada dama um tenha certo,
');
VALUES (539, 541, TIMESTAMP WITH TIME ZONE '2020-07-18 08:28:54+00', 'Que também dela hão medo os Elementos!
');

VALUES (540, 542, TIMESTAMP WITH TIME ZONE '2018-10-02 23:07:07+00', 'Na grande sala, nobre e divinal;
');
VALUES (540, 629, TIMESTAMP WITH TIME ZONE '2018-10-03 03:32:18+00', 'O que arcos e pelouros não fizeram.
');

VALUES (541, 614, TIMESTAMP WITH TIME ZONE '2020-07-05 09:07:16+00', 'O Catual na história bem distinta;
');
VALUES (541, 543, TIMESTAMP WITH TIME ZONE '2020-07-05 13:24:04+00', 'Armou dele os soberbos moradores,
');
VALUES (541, 543, TIMESTAMP WITH TIME ZONE '2020-07-05 18:46:08+00', 'Mas queimar-lhe-á lugares, templos, casas;
');

VALUES (542, 544, TIMESTAMP WITH TIME ZONE '2020-04-28 17:02:31+00', 'Louva o Rei o sublime coração
');
VALUES (542, 624, TIMESTAMP WITH TIME ZONE '2020-04-28 19:09:59+00', 'Assim no Reino forte aconteceu,
');
VALUES (542, 624, TIMESTAMP WITH TIME ZONE '2020-04-29 01:05:27+00', 'Quão doce é o louvor e a justa glória
');
VALUES (542, 544, TIMESTAMP WITH TIME ZONE '2020-04-29 06:40:05+00', 'Tão incertas viagens e remotas?
');

VALUES (543, 585, TIMESTAMP WITH TIME ZONE '2019-05-12 17:04:15+00', 'Temistitão, nos fins Ocidentais;
');

VALUES (544, 546, TIMESTAMP WITH TIME ZONE '2019-05-26 19:45:15+00', 'E na ambição também, que indignamente
');
VALUES (544, 546, TIMESTAMP WITH TIME ZONE '2019-05-27 02:56:25+00', 'Entraram pela foz do Tejo ameno,
');
VALUES (544, 621, TIMESTAMP WITH TIME ZONE '2019-05-27 06:48:43+00', 'Agasalhados foram juntamente
');

VALUES (545, 675, TIMESTAMP WITH TIME ZONE '2020-06-23 06:48:52+00', 'Cortava o mar a gente belicosa,
');

VALUES (546, 547, TIMESTAMP WITH TIME ZONE '2021-03-04 23:39:14+00', 'Arrancam das espadas de aço fino
');
VALUES (546, 547, TIMESTAMP WITH TIME ZONE '2021-03-05 03:24:44+00', 'Tantos muros aspérrimos quebranta,
');
VALUES (546, 694, TIMESTAMP WITH TIME ZONE '2021-03-05 10:48:21+00', 'Viam-se em derredor ferver as praias
');

VALUES (547, 548, TIMESTAMP WITH TIME ZONE '2020-10-23 19:03:25+00', 'Vê Catigão, cidade das milhores
');
VALUES (547, 671, TIMESTAMP WITH TIME ZONE '2020-10-23 21:51:29+00', 'Treme a bandeira, voa o estandarte,
');
VALUES (547, 548, TIMESTAMP WITH TIME ZONE '2020-10-24 03:35:24+00', 'Do Céu supremo quis que povoasse.
');
VALUES (547, 671, TIMESTAMP WITH TIME ZONE '2020-10-24 07:52:25+00', 'E, para mais sinal d''amor profundo,
');

VALUES (548, 659, TIMESTAMP WITH TIME ZONE '2019-10-22 09:02:48+00', 'Tantas recebe d'' outro só no Estio,
');

VALUES (549, 550, TIMESTAMP WITH TIME ZONE '2020-11-01 19:52:33+00', 'Se a corrompida fama lhe concede.
');
VALUES (549, 630, TIMESTAMP WITH TIME ZONE '2020-11-02 00:06:39+00', 'Vai a linda Dione furiosa;
');

VALUES (550, 635, TIMESTAMP WITH TIME ZONE '2020-05-23 09:43:08+00', 'A Castela, onde o preço sós levaram
');
VALUES (550, 635, TIMESTAMP WITH TIME ZONE '2020-05-23 15:16:33+00', 'Ditosa pátria que tal filho teve!
');

VALUES (551, 649, TIMESTAMP WITH TIME ZONE '2021-02-08 22:17:21+00', 'Rege-o um capitão de fronte lisa,
');
VALUES (551, 649, TIMESTAMP WITH TIME ZONE '2021-02-09 02:10:07+00', 'Os povos Abassis, de Crista amigos;
');

VALUES (552, 575, TIMESTAMP WITH TIME ZONE '2021-02-28 05:09:15+00', 'Assi foram cortando o mar sereno,
');
VALUES (552, 575, TIMESTAMP WITH TIME ZONE '2021-02-28 07:33:29+00', 'De vassalo, que a tanto se obrigava!
');
VALUES (552, 553, TIMESTAMP WITH TIME ZONE '2021-02-28 13:20:33+00', 'A guerra com que a pátria se sustinha;
');

VALUES (553, 606, TIMESTAMP WITH TIME ZONE '2020-11-07 21:26:04+00', 'Vejo um estranho vir de pele preta,
');
VALUES (553, 606, TIMESTAMP WITH TIME ZONE '2020-11-08 00:44:27+00', 'Dizei-lhe que também dos Portugueses
');
VALUES (553, 554, TIMESTAMP WITH TIME ZONE '2020-11-08 08:38:58+00', 'Mas, vendo o ilustre Persa que vencido
');
VALUES (553, 554, TIMESTAMP WITH TIME ZONE '2020-11-08 11:08:20+00', 'Nome antigo e de grande proeminência:
');

VALUES (554, 555, TIMESTAMP WITH TIME ZONE '2019-08-07 17:22:28+00', 'Aqui tens com quem podes consolar-te!
');
VALUES (554, 555, TIMESTAMP WITH TIME ZONE '2019-08-08 01:16:04+00', 'Abrindo-o, vence as ondas e os perigos,
');

VALUES (555, 658, TIMESTAMP WITH TIME ZONE '2020-12-02 09:39:44+00', 'Fazendo-a a várias gentes subjugada,
');

VALUES (556, 595, TIMESTAMP WITH TIME ZONE '2020-06-28 16:00:19+00', 'Temer poder maior, por mais pequeno.
');

VALUES (557, 626, TIMESTAMP WITH TIME ZONE '2020-06-22 05:46:27+00', 'Toda esta costa enfim, que agora urdia
');
VALUES (557, 557, TIMESTAMP WITH TIME ZONE '2020-06-22 10:28:28+00', 'Nos altíssimos mares, que cresceram,
');
VALUES (557, 557, TIMESTAMP WITH TIME ZONE '2020-06-22 17:56:38+00', 'Mas a militar arte e engenho logo
');
VALUES (557, 626, TIMESTAMP WITH TIME ZONE '2020-06-22 18:00:29+00', 'O que às mãos cobiçosas vão negando.
');

VALUES (558, 558, TIMESTAMP WITH TIME ZONE '2020-10-30 19:16:19+00', 'Suspeitas das insídias que ordenava
');

VALUES (559, 559, TIMESTAMP WITH TIME ZONE '2019-06-05 05:23:50+00', 'Chovem sobre nós outros sem medida;
');
VALUES (559, 621, TIMESTAMP WITH TIME ZONE '2019-06-05 08:26:11+00', 'Confessar-me a verdade limpa e nua,
');
VALUES (559, 621, TIMESTAMP WITH TIME ZONE '2019-06-05 09:14:32+00', 'Tomando-o pela mão, o leva e guia
');

VALUES (560, 559, TIMESTAMP WITH TIME ZONE '2020-05-17 11:32:22+00', 'Da vinda tua, tem tanta alegria,
');
VALUES (560, 559, TIMESTAMP WITH TIME ZONE '2020-05-17 14:41:31+00', 'Se parte diligente da cidade;
');

VALUES (561, 647, TIMESTAMP WITH TIME ZONE '2020-04-30 15:26:46+00', 'Se lá passar a Lusitana gente.
');

VALUES (562, 604, TIMESTAMP WITH TIME ZONE '2020-05-28 03:54:36+00', 'O nosso Capitão esclarecido
');

VALUES (563, 579, TIMESTAMP WITH TIME ZONE '2020-06-14 03:51:41+00', 'No nunca descansado e fero grêmio
');
VALUES (563, 561, TIMESTAMP WITH TIME ZONE '2020-06-14 09:31:37+00', 'Cidade populosa e tão potente:
');
VALUES (563, 561, TIMESTAMP WITH TIME ZONE '2020-06-14 15:06:38+00', 'Por que is aventurar ao mar iroso
');
VALUES (563, 561, TIMESTAMP WITH TIME ZONE '2020-06-14 17:39:00+00', '"Sabe que há muitos anos que os antigos
');

VALUES (564, 640, TIMESTAMP WITH TIME ZONE '2019-10-19 19:52:45+00', 'Não menos guarnecido o Lusitano
');
VALUES (564, 563, TIMESTAMP WITH TIME ZONE '2019-10-20 01:26:06+00', 'Tomou mais a conquista do mar largo.
');
VALUES (564, 640, TIMESTAMP WITH TIME ZONE '2019-10-20 02:28:24+00', 'Entre todos as partes em porfia,
');
VALUES (564, 563, TIMESTAMP WITH TIME ZONE '2019-10-20 08:29:51+00', 'Mas já o Céu inquieto revolvendo,
');

VALUES (565, 651, TIMESTAMP WITH TIME ZONE '2020-03-22 12:48:11+00', 'Um pacífico porto o sossegado,
');
VALUES (565, 651, TIMESTAMP WITH TIME ZONE '2020-03-22 18:25:20+00', 'Por quem pudesse à Índia ser levado;
');
VALUES (565, 563, TIMESTAMP WITH TIME ZONE '2020-03-22 23:18:56+00', 'Destruídos depois da Grega insânia.
');

VALUES (566, 684, TIMESTAMP WITH TIME ZONE '2020-10-08 08:17:06+00', 'Mas África dirá ser impossíbil
');
VALUES (566, 684, TIMESTAMP WITH TIME ZONE '2020-10-08 10:39:38+00', 'Como já foram homens de alta sorte,
');
VALUES (566, 684, TIMESTAMP WITH TIME ZONE '2020-10-08 15:16:52+00', 'Fala do Samorim ao Gama
');

VALUES (567, 565, TIMESTAMP WITH TIME ZONE '2021-02-28 20:42:59+00', 'As lágrimas lhe alimpa, e acendido
');
VALUES (567, 571, TIMESTAMP WITH TIME ZONE '2021-02-28 23:15:41+00', 'Mas assim como a Aurora marchetada
');
VALUES (567, 571, TIMESTAMP WITH TIME ZONE '2021-03-01 02:54:24+00', 'Que primeiro amainou, que desse o vento.
');

VALUES (568, 565, TIMESTAMP WITH TIME ZONE '2019-05-08 03:29:48+00', 'Por te fazer saber que tudo aquilo
');

VALUES (569, 639, TIMESTAMP WITH TIME ZONE '2020-08-13 15:21:54+00', 'Despois, Capitão-mor do Índico mar,
');
VALUES (569, 566, TIMESTAMP WITH TIME ZONE '2020-08-13 16:33:38+00', 'Gangético, o rumor antigo conta
');
VALUES (569, 639, TIMESTAMP WITH TIME ZONE '2020-08-13 19:37:44+00', 'Que inimiga não há, tão dura e fera,
');
VALUES (569, 566, TIMESTAMP WITH TIME ZONE '2020-08-14 02:32:47+00', 'Soberbas e insolências tais, que temo
');

VALUES (570, 566, TIMESTAMP WITH TIME ZONE '2020-08-31 18:08:59+00', 'E consigo trará a formosa dama
');
VALUES (570, 678, TIMESTAMP WITH TIME ZONE '2020-08-31 23:07:54+00', 'Já serás sabedor, e dos enganos
');
VALUES (570, 566, TIMESTAMP WITH TIME ZONE '2020-09-01 01:26:44+00', 'Mas pois saber humano nem prudência
');
VALUES (570, 678, TIMESTAMP WITH TIME ZONE '2020-09-01 06:30:19+00', 'Arruinar a máquina do mundo:
');

VALUES (571, 567, TIMESTAMP WITH TIME ZONE '2020-10-09 07:07:48+00', 'Dos filhos e das filhas que gerara;
');
VALUES (571, 567, TIMESTAMP WITH TIME ZONE '2020-10-09 11:24:48+00', 'O prazer de chegar à pátria cara,
');

VALUES (572, 568, TIMESTAMP WITH TIME ZONE '2020-07-20 16:47:01+00', 'A causa principal do reboliço:
');
VALUES (572, 568, TIMESTAMP WITH TIME ZONE '2020-07-20 21:05:50+00', 'No animal Nemeio truculento,
');

VALUES (573, 607, TIMESTAMP WITH TIME ZONE '2021-02-28 16:14:49+00', 'De lhe serem leais esta viagem.
');
VALUES (573, 607, TIMESTAMP WITH TIME ZONE '2021-02-28 22:42:31+00', 'Em cujo corpo a morte e o ferro entrava:
');
VALUES (573, 607, TIMESTAMP WITH TIME ZONE '2021-02-28 23:44:18+00', '"Eu sou bem informado que a embaixada
');

VALUES (574, 571, TIMESTAMP WITH TIME ZONE '2021-03-08 18:22:53+00', 'Que achar gente vizinha em terra estranha.
');
VALUES (574, 616, TIMESTAMP WITH TIME ZONE '2021-03-09 01:05:57+00', 'Que pressupôs de nela morrer santo.
');
VALUES (574, 571, TIMESTAMP WITH TIME ZONE '2021-03-09 03:01:07+00', 'E faz vir a passar o último dano:
');

VALUES (575, 577, TIMESTAMP WITH TIME ZONE '2020-11-19 09:03:23+00', 'O que de Cipião se sabe e alcança,
');
VALUES (575, 577, TIMESTAMP WITH TIME ZONE '2020-11-19 14:17:42+00', 'De poder defender se não contenta
');
VALUES (575, 577, TIMESTAMP WITH TIME ZONE '2020-11-19 21:24:44+00', 'Onde os hóspedes tristes imolava,
');
VALUES (575, 572, TIMESTAMP WITH TIME ZONE '2020-11-20 04:44:57+00', 'Que quem vai contra os vossos, claro veja
');

VALUES (576, 572, TIMESTAMP WITH TIME ZONE '2020-10-27 21:02:57+00', 'Por lhe defender a água desejada,
');
VALUES (576, 601, TIMESTAMP WITH TIME ZONE '2020-10-28 02:43:49+00', 'De áspero som, horríssono ao ouvido,
');
VALUES (576, 601, TIMESTAMP WITH TIME ZONE '2020-10-28 06:12:37+00', 'Sirenas que com o canto os adormeçam;
');
VALUES (576, 601, TIMESTAMP WITH TIME ZONE '2020-10-28 09:42:02+00', 'Aqui vereis, ó Deuses, como ensinam
');

VALUES (577, 678, TIMESTAMP WITH TIME ZONE '2019-12-04 23:20:27+00', 'Em desusada e má deslealdade;
');

VALUES (578, 577, TIMESTAMP WITH TIME ZONE '2019-08-06 16:07:24+00', 'Vencidos vêm do sono, e mal despertos;
');
VALUES (578, 577, TIMESTAMP WITH TIME ZONE '2019-08-06 19:38:22+00', 'Tanto Deus se contenta de humildade!
');
VALUES (578, 573, TIMESTAMP WITH TIME ZONE '2019-08-07 00:19:47+00', 'Cá na Europa Lisboa ingente funda."
');

VALUES (579, 574, TIMESTAMP WITH TIME ZONE '2021-02-10 06:08:17+00', 'Quem contra o Rei e a Pátria se alevanta:
');
VALUES (579, 574, TIMESTAMP WITH TIME ZONE '2021-02-10 12:28:41+00', 'O que o ledo Monçaide lhe oferece;
');
VALUES (579, 574, TIMESTAMP WITH TIME ZONE '2021-02-10 19:56:59+00', 'E com forçar o rosto, que se enfia,
');
VALUES (579, 574, TIMESTAMP WITH TIME ZONE '2021-02-11 01:01:55+00', 'Co''o vulto alegre, qual do Céu subido,
');

VALUES (580, 604, TIMESTAMP WITH TIME ZONE '2021-03-25 13:27:51+00', 'Na mão a grande concha retorcida
');
VALUES (580, 574, TIMESTAMP WITH TIME ZONE '2021-03-25 15:21:01+00', 'De Áf rico e Noto a força, a mais se atreve:
');
VALUES (580, 604, TIMESTAMP WITH TIME ZONE '2021-03-25 19:59:43+00', 'Da boca dos pequenos sei, contudo,
');

VALUES (581, 687, TIMESTAMP WITH TIME ZONE '2020-07-23 01:24:53+00', 'Vai ferir noutra parte luminoso,
');

VALUES (582, 669, TIMESTAMP WITH TIME ZONE '2020-07-18 03:48:08+00', 'O Sol, que para o Norte os carros guia,
');
VALUES (582, 669, TIMESTAMP WITH TIME ZONE '2020-07-18 09:00:47+00', 'Converte em pedra o pau que nele cai.
');
VALUES (582, 669, TIMESTAMP WITH TIME ZONE '2020-07-18 16:40:31+00', 'Mas os Mouros que andavam pela praia,
');

VALUES (583, 611, TIMESTAMP WITH TIME ZONE '2019-02-18 03:20:54+00', 'Do terreno, fazendo-o Quersoneso.
');
VALUES (583, 577, TIMESTAMP WITH TIME ZONE '2019-02-18 04:46:43+00', 'A fortuna mo traz peregrinando,
');
VALUES (583, 577, TIMESTAMP WITH TIME ZONE '2019-02-18 06:05:22+00', 'Que em si escondem os régios aposentos,
');
VALUES (583, 577, TIMESTAMP WITH TIME ZONE '2019-02-18 12:10:56+00', '-"Pois eu, responde, estou sacrificando."--
');

VALUES (584, 627, TIMESTAMP WITH TIME ZONE '2021-04-26 04:28:34+00', 'Lhe atalha o poderoso e grão Tonante.
');
VALUES (584, 627, TIMESTAMP WITH TIME ZONE '2021-04-26 09:49:59+00', 'Não menos guarnecido o Lusitano
');
VALUES (584, 627, TIMESTAMP WITH TIME ZONE '2021-04-26 14:16:04+00', 'E tem co Mar a Terra por seu centro.
');

VALUES (585, 579, TIMESTAMP WITH TIME ZONE '2020-02-17 20:32:42+00', 'Vendo vários costumes, várias manhas,
');
VALUES (585, 593, TIMESTAMP WITH TIME ZONE '2020-02-18 02:01:49+00', '"Não matou a quarta parte o forte Mário
');
VALUES (585, 579, TIMESTAMP WITH TIME ZONE '2020-02-18 05:29:14+00', '--"Dura inquietação d''alma e da vida,
');
VALUES (585, 593, TIMESTAMP WITH TIME ZONE '2020-02-18 06:20:47+00', 'Na geração de Adão, coa falsidade,
');

VALUES (586, 580, TIMESTAMP WITH TIME ZONE '2020-11-18 10:33:08+00', 'Com que a torne a tomar, que esforço e arte
');
VALUES (586, 638, TIMESTAMP WITH TIME ZONE '2020-11-18 14:31:20+00', 'Numa alma, doce, incógnita alegria,
');

VALUES (587, 582, TIMESTAMP WITH TIME ZONE '2020-04-19 00:21:48+00', '"Mas na Índia, cobiça e ambição,
');

VALUES (588, 653, TIMESTAMP WITH TIME ZONE '2020-04-21 11:31:14+00', 'Tanta veneração aos pais se deve!
');

VALUES (589, 691, TIMESTAMP WITH TIME ZONE '2021-04-13 19:03:46+00', 'Com que em tão duro estado me deitaram.
');
VALUES (589, 691, TIMESTAMP WITH TIME ZONE '2021-04-13 23:28:03+00', 'Mais do que prometia a força humana,
');
VALUES (589, 583, TIMESTAMP WITH TIME ZONE '2021-04-14 06:40:43+00', 'Com a gente, e com as novas muito mais:
');
VALUES (589, 583, TIMESTAMP WITH TIME ZONE '2021-04-14 13:22:32+00', '"Deus por certo vos traz, porque pretende
');

VALUES (590, 585, TIMESTAMP WITH TIME ZONE '2019-04-19 17:12:44+00', 'Quando dá a grande e súbita procela:
');

VALUES (591, 618, TIMESTAMP WITH TIME ZONE '2020-03-10 12:25:35+00', 'A qual Coulão, a qual dá Cranganor,
');
VALUES (591, 585, TIMESTAMP WITH TIME ZONE '2020-03-10 19:37:22+00', 'Nunca s''ergue ou se abaxa, e um mesmo rosto
');
VALUES (591, 618, TIMESTAMP WITH TIME ZONE '2020-03-11 02:00:44+00', 'E, sendo da ociosa mão movido
');

VALUES (592, 586, TIMESTAMP WITH TIME ZONE '2020-07-13 07:21:36+00', 'De quantos bebem a água de Parnaso.
');

VALUES (593, 587, TIMESTAMP WITH TIME ZONE '2020-10-16 03:41:58+00', 'Para o segundo os outros despertavam.
');
VALUES (593, 609, TIMESTAMP WITH TIME ZONE '2020-10-16 06:48:25+00', 'Mar Roxo, que do fundo toma as cores;
');
VALUES (593, 587, TIMESTAMP WITH TIME ZONE '2020-10-16 14:24:05+00', 'Araspas, de Panteia, em fogo ardente,
');
VALUES (593, 609, TIMESTAMP WITH TIME ZONE '2020-10-16 15:59:56+00', 'Os formosos limões ali, cheirando,
');

VALUES (594, 587, TIMESTAMP WITH TIME ZONE '2019-11-06 15:22:42+00', 'Dino da eterna pena do profundo,
');

VALUES (595, 625, TIMESTAMP WITH TIME ZONE '2020-07-29 21:53:40+00', 'E quase o Reino todo reformou
');

VALUES (596, 675, TIMESTAMP WITH TIME ZONE '2020-08-03 21:24:40+00', 'Pluma na gorra, um pouco declinada.
');
VALUES (596, 589, TIMESTAMP WITH TIME ZONE '2020-08-04 03:49:38+00', 'Que quem há, que por fama não conhece
');

VALUES (597, 667, TIMESTAMP WITH TIME ZONE '2021-01-17 13:40:47+00', 'Que o corpo cristalino deixa ver-se,
');

VALUES (598, 677, TIMESTAMP WITH TIME ZONE '2018-07-05 07:19:03+00', 'Que não haja no mar mais navegantes.
');
VALUES (598, 591, TIMESTAMP WITH TIME ZONE '2018-07-05 08:40:55+00', 'Cá na Europa Lisboa ingente funda."
');
VALUES (598, 677, TIMESTAMP WITH TIME ZONE '2018-07-05 14:49:50+00', 'Que variadas são de muitas cores.
');
VALUES (598, 677, TIMESTAMP WITH TIME ZONE '2018-07-05 17:30:53+00', 'A vida em salvo escapa por acerto.
');

VALUES (599, 605, TIMESTAMP WITH TIME ZONE '2020-01-24 14:00:03+00', 'Já no batel entrou do Capitão
');
VALUES (599, 605, TIMESTAMP WITH TIME ZONE '2020-01-24 16:49:55+00', 'Os Laos, em terra e número potentes;
');
VALUES (599, 605, TIMESTAMP WITH TIME ZONE '2020-01-24 23:06:37+00', '"Goa vereis aos Mouros ser tomada,
');

VALUES (600, 593, TIMESTAMP WITH TIME ZONE '2020-03-27 10:06:08+00', 'Contra um bicho da terra tão pequeno?
');
VALUES (600, 593, TIMESTAMP WITH TIME ZONE '2020-03-27 10:37:29+00', 'De Dio, ilustre em cercos e batalhas,
');

VALUES (601, 689, TIMESTAMP WITH TIME ZONE '2020-05-23 04:55:13+00', 'Quedas coas duras armas, tudo atroam;
');
VALUES (601, 689, TIMESTAMP WITH TIME ZONE '2020-05-23 11:08:11+00', 'Que os Melindanos têm tão rudo peito,
');

VALUES (602, 617, TIMESTAMP WITH TIME ZONE '2020-10-19 12:23:02+00', 'Tal Joane, com outros escolhidos
');
VALUES (602, 594, TIMESTAMP WITH TIME ZONE '2020-10-19 15:09:44+00', 'Da cinta para cima vêm despidos;
');

VALUES (603, 634, TIMESTAMP WITH TIME ZONE '2018-11-01 06:43:10+00', 'Posto que o frio Fásis, ou Siene,
');
VALUES (603, 596, TIMESTAMP WITH TIME ZONE '2018-11-01 12:22:22+00', 'Em quem o pai deixava seu traslado,
');

VALUES (604, 599, TIMESTAMP WITH TIME ZONE '2020-01-23 03:14:03+00', 'Pera servir-vos, braço às armas feito,
');
VALUES (604, 599, TIMESTAMP WITH TIME ZONE '2020-01-23 05:53:54+00', 'Nos braços tendo o filho, confiada
');
VALUES (604, 655, TIMESTAMP WITH TIME ZONE '2020-01-23 08:39:56+00', 'Quisera o Rei sublime ser primeiro,
');

VALUES (605, 605, TIMESTAMP WITH TIME ZONE '2020-02-10 16:51:39+00', 'Lhe leva um cego tiro que passara,
');
VALUES (605, 600, TIMESTAMP WITH TIME ZONE '2020-02-10 18:33:30+00', 'Disse alegre o piloto Melindano:
');
VALUES (605, 605, TIMESTAMP WITH TIME ZONE '2020-02-10 19:11:34+00', 'A campina, que toda está coalhada
');

VALUES (606, 600, TIMESTAMP WITH TIME ZONE '2020-04-02 07:02:19+00', 'Dos inimigos a terra lhe corria,
');

VALUES (607, 601, TIMESTAMP WITH TIME ZONE '2020-10-20 08:02:43+00', 'E os mais, a quem o mais serve e contenta,
');

VALUES (608, 679, TIMESTAMP WITH TIME ZONE '2020-12-22 02:08:51+00', 'A frota coas bombardas o festeja,
');
VALUES (608, 602, TIMESTAMP WITH TIME ZONE '2020-12-22 09:45:53+00', 'Das que pimenta ali têm produzido.
');
VALUES (608, 679, TIMESTAMP WITH TIME ZONE '2020-12-22 14:51:52+00', 'Que as Estrelas e o Céu e o Ar vizinho,
');
VALUES (608, 602, TIMESTAMP WITH TIME ZONE '2020-12-22 18:35:42+00', 'Pois os vedados términos quebrantas,
');

VALUES (609, 623, TIMESTAMP WITH TIME ZONE '2019-05-02 01:50:44+00', '"Ali, Cafres selvagens poderão
');
VALUES (609, 623, TIMESTAMP WITH TIME ZONE '2019-05-02 08:56:20+00', 'Nas pontas pendurados não falecem
');
VALUES (609, 602, TIMESTAMP WITH TIME ZONE '2019-05-02 10:03:28+00', 'Lá no novo Hemisfério, nova estrela,
');
VALUES (609, 623, TIMESTAMP WITH TIME ZONE '2019-05-02 13:53:23+00', 'Assopra-lhe galerno o vento, e brando,
');

VALUES (610, 605, TIMESTAMP WITH TIME ZONE '2020-09-19 22:53:34+00', 'Remédios contra o sono buscar querem,
');

VALUES (611, 607, TIMESTAMP WITH TIME ZONE '2021-02-15 05:11:18+00', 'Adúltera inclinava os animais
');
VALUES (611, 607, TIMESTAMP WITH TIME ZONE '2021-02-15 09:20:35+00', 'E depois por Jesu certificado.
');
VALUES (611, 607, TIMESTAMP WITH TIME ZONE '2021-02-15 15:40:38+00', 'Que mais chegada à terra parecia,
');
VALUES (611, 640, TIMESTAMP WITH TIME ZONE '2021-02-15 17:36:59+00', '(Se de humano é matar uma donzela
');

VALUES (612, 667, TIMESTAMP WITH TIME ZONE '2021-02-28 22:36:26+00', 'E outra terra acharás de mais verdade,
');

VALUES (613, 629, TIMESTAMP WITH TIME ZONE '2019-09-30 14:28:55+00', 'Com mais noventa e sete, em que corria,
');
VALUES (613, 608, TIMESTAMP WITH TIME ZONE '2019-09-30 21:03:43+00', 'Já murmurando a Fama penetrante
');
VALUES (613, 608, TIMESTAMP WITH TIME ZONE '2019-10-01 04:00:26+00', 'Viera pôr perpétua inimicícia
');

VALUES (614, 609, TIMESTAMP WITH TIME ZONE '2020-09-20 17:08:12+00', 'Com medo o Roxo Mar fará amarelo.
');
VALUES (614, 609, TIMESTAMP WITH TIME ZONE '2020-09-20 18:59:36+00', 'Ele, que no conceito vil conspira,
');

VALUES (615, 613, TIMESTAMP WITH TIME ZONE '2020-12-10 02:11:53+00', 'Não conceberas tu tão má suspeita.
');
VALUES (615, 613, TIMESTAMP WITH TIME ZONE '2020-12-10 02:47:09+00', 'E Dione, que as rosas entro a neve
');
VALUES (615, 688, TIMESTAMP WITH TIME ZONE '2020-12-10 04:16:21+00', 'Um dos duros ministros rigorosos;
');
VALUES (615, 688, TIMESTAMP WITH TIME ZONE '2020-12-10 05:57:45+00', 'Por perdidos as gentes nos julgavam;
');

VALUES (616, 682, TIMESTAMP WITH TIME ZONE '2021-01-26 13:56:40+00', 'A Fé, o Império, e as terras viciosas
');
VALUES (616, 682, TIMESTAMP WITH TIME ZONE '2021-01-26 17:59:09+00', 'De bívoras encheste a ardente areia.
');

VALUES (617, 614, TIMESTAMP WITH TIME ZONE '2020-09-04 09:21:09+00', 'Em desafios, justas e torneios,
');
VALUES (617, 652, TIMESTAMP WITH TIME ZONE '2020-09-04 10:27:28+00', 'Como quem tinha em Deus a seguraria
');
VALUES (617, 652, TIMESTAMP WITH TIME ZONE '2020-09-04 16:26:55+00', 'Como menino da ama castigado,
');
VALUES (617, 652, TIMESTAMP WITH TIME ZONE '2020-09-04 21:07:45+00', 'Leis em favor do Rei se estabelecem,
');

VALUES (618, 614, TIMESTAMP WITH TIME ZONE '2020-06-04 09:36:45+00', 'Pluma na gorra, um pouco declinada.
');
VALUES (618, 644, TIMESTAMP WITH TIME ZONE '2020-06-04 09:59:30+00', 'De outra alguma no preço e no lavor.
');
VALUES (618, 644, TIMESTAMP WITH TIME ZONE '2020-06-04 10:04:35+00', 'A frota de seu Rei, que tem segura.
');
VALUES (618, 614, TIMESTAMP WITH TIME ZONE '2020-06-04 12:08:50+00', 'De amor dos pátrios feitos valerosos,
');

VALUES (619, 646, TIMESTAMP WITH TIME ZONE '2019-03-01 09:23:43+00', 'Na férvida e implacável espessura.
');
VALUES (619, 615, TIMESTAMP WITH TIME ZONE '2019-03-01 11:10:18+00', 'Quanto no rico, assim como no pobre,
');
VALUES (619, 646, TIMESTAMP WITH TIME ZONE '2019-03-01 17:23:26+00', 'Ali tinha em retrato afigurada
');

VALUES (620, 615, TIMESTAMP WITH TIME ZONE '2021-03-12 13:59:41+00', 'Torvado um pouco está, mas não medroso.
');
VALUES (620, 615, TIMESTAMP WITH TIME ZONE '2021-03-12 21:16:23+00', 'Que esta perna trouxe eu dali ferida;
');
VALUES (620, 632, TIMESTAMP WITH TIME ZONE '2021-03-13 02:31:08+00', 'Dos amores de Inês que ali passaram.
');

VALUES (621, 626, TIMESTAMP WITH TIME ZONE '2019-03-02 06:08:10+00', 'Que o povo forte tem de si inimigo:
');
VALUES (621, 626, TIMESTAMP WITH TIME ZONE '2019-03-02 08:04:58+00', 'Por este mar a gente Lusitana,
');
VALUES (621, 616, TIMESTAMP WITH TIME ZONE '2019-03-02 08:12:07+00', 'No governo do Império, cujo zelo
');

VALUES (622, 642, TIMESTAMP WITH TIME ZONE '2021-03-09 15:30:31+00', 'Pendendo estavam todos embebidos,
');
VALUES (622, 616, TIMESTAMP WITH TIME ZONE '2021-03-09 17:32:52+00', 'Mas olha um Eclesiástico guerreiro,
');
VALUES (622, 642, TIMESTAMP WITH TIME ZONE '2021-03-09 20:12:09+00', 'A se lograr da paz com tanta glória
');
VALUES (622, 642, TIMESTAMP WITH TIME ZONE '2021-03-10 03:36:33+00', 'Sem vento suas águas encrespando.
');

VALUES (623, 669, TIMESTAMP WITH TIME ZONE '2020-11-18 11:25:15+00', 'As inquietas ondas apartando;
');
VALUES (623, 617, TIMESTAMP WITH TIME ZONE '2020-11-18 12:20:21+00', 'Entre tormentas tristes e bonanças,
');
VALUES (623, 669, TIMESTAMP WITH TIME ZONE '2020-11-18 12:21:43+00', 'Culpa dos viciosos sucessores,
');

VALUES (624, 619, TIMESTAMP WITH TIME ZONE '2020-03-01 07:49:34+00', 'As Portuguesas forças, costumadas
');
VALUES (624, 691, TIMESTAMP WITH TIME ZONE '2020-03-01 10:20:34+00', 'Veias d''ouro que a terra produziu,
');

VALUES (625, 619, TIMESTAMP WITH TIME ZONE '2020-07-15 14:58:51+00', 'Verão da desventura grandes modos:
');
VALUES (625, 675, TIMESTAMP WITH TIME ZONE '2020-07-15 21:11:02+00', 'Quem foi seu matador, e será crido
');

VALUES (626, 655, TIMESTAMP WITH TIME ZONE '2020-02-13 00:29:57+00', 'Matéria é de coturno, e não de soco,
');

VALUES (627, 620, TIMESTAMP WITH TIME ZONE '2019-07-05 00:10:25+00', 'Era esta grão vitória, o Rei subido
');

VALUES (628, 623, TIMESTAMP WITH TIME ZONE '2019-06-01 03:58:25+00', 'Com faina suas obras valerosas,
');
VALUES (628, 623, TIMESTAMP WITH TIME ZONE '2019-06-01 10:38:39+00', 'Do metal que a cor tem do louro Apolo.
');
VALUES (628, 672, TIMESTAMP WITH TIME ZONE '2019-06-01 12:36:20+00', 'Sem ter necessidade de cultura,
');
VALUES (628, 623, TIMESTAMP WITH TIME ZONE '2019-06-01 14:56:50+00', '"Olha o reino Arracão; olha o assento
');

VALUES (629, 624, TIMESTAMP WITH TIME ZONE '2020-02-27 04:59:57+00', 'De minha temerária confiança,
');

VALUES (630, 667, TIMESTAMP WITH TIME ZONE '2020-01-27 15:08:55+00', 'Se enfraqueça e se vá deitando a longe?
');
VALUES (630, 624, TIMESTAMP WITH TIME ZONE '2020-01-27 16:24:27+00', 'Do generoso Mouro, que pasmava
');

VALUES (631, 664, TIMESTAMP WITH TIME ZONE '2020-08-07 19:13:08+00', 'Com o sangue de seus donos Castelhano.
');

VALUES (632, 688, TIMESTAMP WITH TIME ZONE '2021-03-12 03:42:30+00', 'Ali co''o Tigre o Eufrates se mistura,
');

VALUES (633, 643, TIMESTAMP WITH TIME ZONE '2020-11-01 21:11:08+00', 'Do Capitão e gente se apartou
');
VALUES (633, 628, TIMESTAMP WITH TIME ZONE '2020-11-02 00:21:08+00', 'As velas, com que, vêm, eram de esteira
');
VALUES (633, 628, TIMESTAMP WITH TIME ZONE '2020-11-02 02:05:54+00', 'Informa o cauto Gama das armadas
');
VALUES (633, 643, TIMESTAMP WITH TIME ZONE '2020-11-02 07:35:11+00', 'Obrigado d''amor e d''amizade,
');

VALUES (634, 628, TIMESTAMP WITH TIME ZONE '2020-11-14 15:26:04+00', 'Onde pode acolher-se um fraco humano,
');
VALUES (634, 669, TIMESTAMP WITH TIME ZONE '2020-11-14 22:20:26+00', 'De botões douro as mangas vêm tomadas,
');
VALUES (634, 669, TIMESTAMP WITH TIME ZONE '2020-11-15 03:46:03+00', 'Como por ir ouvindo o doce canto,
');
VALUES (634, 669, TIMESTAMP WITH TIME ZONE '2020-11-15 09:11:49+00', 'Na falsa opinião, que em sacrifícios
');

VALUES (635, 629, TIMESTAMP WITH TIME ZONE '2021-01-20 02:52:24+00', 'Mas ficou duvidoso o vencimento.
');
VALUES (635, 629, TIMESTAMP WITH TIME ZONE '2021-01-20 06:39:50+00', 'Partem as almadias a buscar
');

VALUES (636, 630, TIMESTAMP WITH TIME ZONE '2020-10-01 10:19:58+00', 'Como por regimento enfim levava,
');

VALUES (637, 632, TIMESTAMP WITH TIME ZONE '2021-04-04 14:50:32+00', 'Pazes cometer manda arrependido
');
VALUES (637, 694, TIMESTAMP WITH TIME ZONE '2021-04-04 22:06:30+00', 'De ver eousas estranhas desejosa
');
VALUES (637, 694, TIMESTAMP WITH TIME ZONE '2021-04-05 04:40:15+00', 'Me anda Tétis cercando destas águas."--
');
VALUES (637, 632, TIMESTAMP WITH TIME ZONE '2021-04-05 07:48:13+00', '"Porém, como a luz crástina chegada
');

VALUES (638, 658, TIMESTAMP WITH TIME ZONE '2021-03-23 19:19:00+00', 'As filhas de Nereu, no ponto fundo,
');
VALUES (638, 658, TIMESTAMP WITH TIME ZONE '2021-03-24 00:53:28+00', 'Estão para seguir-me a toda parte.
');

VALUES (639, 686, TIMESTAMP WITH TIME ZONE '2018-10-13 17:51:12+00', 'Acharmos já pessoas que sabiam
');
VALUES (639, 633, TIMESTAMP WITH TIME ZONE '2018-10-13 18:29:26+00', 'Nem tão pouco direi que tome tanto
');

VALUES (640, 665, TIMESTAMP WITH TIME ZONE '2019-10-23 00:50:24+00', 'Era para favor dos Lusitanos
');
VALUES (640, 633, TIMESTAMP WITH TIME ZONE '2019-10-23 05:14:35+00', 'Para que do mais certo se informara,
');

VALUES (641, 637, TIMESTAMP WITH TIME ZONE '2019-04-13 20:19:58+00', 'As calças soldadescas recamadas
');
VALUES (641, 637, TIMESTAMP WITH TIME ZONE '2019-04-14 03:01:37+00', 'Debaxo deste leve, anda outro lento,
');
VALUES (641, 634, TIMESTAMP WITH TIME ZONE '2019-04-14 03:43:32+00', 'Para vos ter o mundo em muita estima;
');

VALUES (642, 663, TIMESTAMP WITH TIME ZONE '2021-01-26 04:25:39+00', 'Tantas batalhas dá, nunca cansado,
');

VALUES (643, 635, TIMESTAMP WITH TIME ZONE '2020-05-17 05:22:19+00', 'A todo o Malabar terá admirado.
');
VALUES (643, 637, TIMESTAMP WITH TIME ZONE '2020-05-17 08:51:20+00', 'Vistas enfim de França as coisas grandes,
');
VALUES (643, 637, TIMESTAMP WITH TIME ZONE '2020-05-17 13:22:08+00', 'Tirar à linda dama seus vestidos;
');
VALUES (643, 637, TIMESTAMP WITH TIME ZONE '2020-05-17 14:49:27+00', 'Sem o despedimento costumado,
');

VALUES (644, 635, TIMESTAMP WITH TIME ZONE '2020-08-25 15:05:04+00', 'Histórias contam, casos mil referem.
');

VALUES (645, 693, TIMESTAMP WITH TIME ZONE '2019-04-08 18:22:07+00', 'Com quem sua incontinência desonesta
');
VALUES (645, 636, TIMESTAMP WITH TIME ZONE '2019-04-08 23:18:53+00', 'Governa o Céu, a Terra, e o Mar irado.
');
VALUES (645, 693, TIMESTAMP WITH TIME ZONE '2019-04-09 02:08:12+00', '"Um Sacerdote vê brandindo a espada
');
VALUES (645, 693, TIMESTAMP WITH TIME ZONE '2019-04-09 02:24:55+00', 'Que, com lhe ouvir as últimas razões,
');

VALUES (646, 637, TIMESTAMP WITH TIME ZONE '2020-06-28 19:01:44+00', 'Adúltera inclinava os animais
');
VALUES (646, 637, TIMESTAMP WITH TIME ZONE '2020-06-28 22:49:01+00', 'Os textos; este faz e desfaz leis;
');
VALUES (646, 637, TIMESTAMP WITH TIME ZONE '2020-06-29 01:52:27+00', 'Trazendo fúria e mágoa por antolhos,
');

VALUES (647, 637, TIMESTAMP WITH TIME ZONE '2021-03-03 21:15:03+00', 'Nem das Boreais ondas ao Estreito,
');
VALUES (647, 637, TIMESTAMP WITH TIME ZONE '2021-03-04 03:49:30+00', 'O prazer de chegar à pátria cara,
');
VALUES (647, 637, TIMESTAMP WITH TIME ZONE '2021-03-04 06:04:40+00', 'Engrossando-se vai da gente o fio,
');

VALUES (648, 638, TIMESTAMP WITH TIME ZONE '2020-05-07 20:06:40+00', 'Qualquer nobre trabalha que em memória
');

VALUES (649, 642, TIMESTAMP WITH TIME ZONE '2021-01-26 03:06:36+00', 'Com todo o ajuntamento sempiterno,
');
VALUES (649, 642, TIMESTAMP WITH TIME ZONE '2021-01-26 05:19:03+00', 'Fugindo, veio a ter divino estado,
');
VALUES (649, 642, TIMESTAMP WITH TIME ZONE '2021-01-26 09:15:26+00', 'O grão Rei de Marrocos conduziu
');

VALUES (650, 659, TIMESTAMP WITH TIME ZONE '2020-06-19 04:45:00+00', 'Se perca a gente dela tanto amada.
');
VALUES (650, 639, TIMESTAMP WITH TIME ZONE '2020-06-19 11:47:09+00', 'Tu, claro Tejo, regas tão sereno.
');
VALUES (650, 659, TIMESTAMP WITH TIME ZONE '2020-06-19 12:14:32+00', 'Cantava dum que tem nos Malabares
');
VALUES (650, 639, TIMESTAMP WITH TIME ZONE '2020-06-19 12:59:33+00', 'Não eram os traquetes bem tomados,
');

VALUES (651, 653, TIMESTAMP WITH TIME ZONE '2020-06-25 10:19:19+00', 'De um vulto de Medusa propriamente,
');
VALUES (651, 639, TIMESTAMP WITH TIME ZONE '2020-06-25 17:25:26+00', 'Pronto coa vista, "Terra! Terra!" brada.
');
VALUES (651, 639, TIMESTAMP WITH TIME ZONE '2020-06-25 22:11:24+00', 'Se não manda chegar a terra a armada;
');

VALUES (652, 673, TIMESTAMP WITH TIME ZONE '2019-10-07 00:11:38+00', 'Nascemos: o pesar terá firmeza,
');
VALUES (652, 673, TIMESTAMP WITH TIME ZONE '2019-10-07 03:29:45+00', 'Das filhas de Nereu acompanhada,
');
VALUES (652, 640, TIMESTAMP WITH TIME ZONE '2019-10-07 11:18:21+00', 'Quando no mar a armada se estendia.
');

VALUES (653, 641, TIMESTAMP WITH TIME ZONE '2020-04-05 15:05:41+00', '"Tornado o Rei sublime finalmente,
');
VALUES (653, 683, TIMESTAMP WITH TIME ZONE '2020-04-05 23:05:21+00', 'Obedeceste à força Portuguesa,
');
VALUES (653, 641, TIMESTAMP WITH TIME ZONE '2020-04-06 01:56:30+00', 'Pelo caminho Lácteo glorioso
');

VALUES (654, 642, TIMESTAMP WITH TIME ZONE '2021-02-22 15:23:36+00', 'Pelo mar alto, a qual sujeitaria
');
VALUES (654, 650, TIMESTAMP WITH TIME ZONE '2021-02-22 17:24:22+00', 'De suas mesmas setas traspassado:
');
VALUES (654, 650, TIMESTAMP WITH TIME ZONE '2021-02-22 20:10:20+00', 'E assim entravam ledos e guerreiros.
');
VALUES (654, 650, TIMESTAMP WITH TIME ZONE '2021-02-22 20:31:58+00', 'Por tornar ao trabalho, mais folgado.
');

VALUES (655, 645, TIMESTAMP WITH TIME ZONE '2020-03-08 02:36:18+00', 'O Capitão, que já lhe então convinha
