');
VALUES (658, 670, TIMESTAMP WITH TIME ZONE '2021-01-22 08:33:30+00', 'Um filho seu, de todos estimado,
');
VALUES (658, 670, TIMESTAMP WITH TIME ZONE '2021-01-22 10:02:29+00', 'Da Madre, que nos céus está em essência;
');
VALUES (658, 670, TIMESTAMP WITH TIME ZONE '2021-01-22 14:35:52+00', 'O que às mãos cobiçosas vão negando.
');

VALUES (659, 665, TIMESTAMP WITH TIME ZONE '2020-04-14 20:07:10+00', 'Ela por armas toma a semelhança
');

VALUES (660, 648, TIMESTAMP WITH TIME ZONE '2020-03-21 13:56:19+00', 'Condenaram-no a morte brevemente.
');
VALUES (660, 651, TIMESTAMP WITH TIME ZONE '2020-03-21 17:00:27+00', 'Animais de Moscóvia zebelinos;
');

VALUES (661, 649, TIMESTAMP WITH TIME ZONE '2020-01-11 14:05:47+00', 'Do Gangético mar ao Gaditano,
');
VALUES (661, 649, TIMESTAMP WITH TIME ZONE '2020-01-11 16:11:20+00', 'Que os peitos generosos enobrece,
');
VALUES (661, 649, TIMESTAMP WITH TIME ZONE '2020-01-11 22:45:21+00', 'Pois por quem David Santo se condena?
');

