');
VALUES (662, 649, TIMESTAMP WITH TIME ZONE '2018-11-05 14:48:22+00', 'Ó quanto deve o Rei que bem governa,
');
VALUES (662, 649, TIMESTAMP WITH TIME ZONE '2018-11-05 16:43:07+00', 'Temístoeles despertam só de inveja,
');
VALUES (662, 669, TIMESTAMP WITH TIME ZONE '2018-11-06 00:25:15+00', 'Torna a segui-la; e indo por diante,
');

VALUES (663, 651, TIMESTAMP WITH TIME ZONE '2020-03-23 21:55:51+00', 'Da vitória que logo lhe daria.
');
VALUES (663, 651, TIMESTAMP WITH TIME ZONE '2020-03-23 23:27:08+00', 'Sojuga a fria Sintra o duro braço;
');
VALUES (663, 651, TIMESTAMP WITH TIME ZONE '2020-03-23 23:58:16+00', 'Mas quantos a meu Rei forem contrários."--
');

VALUES (664, 651, TIMESTAMP WITH TIME ZONE '2021-02-05 21:49:29+00', 'Do mar, que contra nós ali corria,
');
VALUES (664, 651, TIMESTAMP WITH TIME ZONE '2021-02-06 00:13:45+00', '"Cinco Reis Mouros são os inimigos,
');

VALUES (665, 680, TIMESTAMP WITH TIME ZONE '2020-12-19 18:53:13+00', '--"Este que vês, pastor já foi de gado;
');
VALUES (665, 680, TIMESTAMP WITH TIME ZONE '2020-12-19 20:49:59+00', '"Quando chegado ao fim de sua idade,
');

